        "caption": "‚ÄúHe dropped out of the sky, truly. He was a math teacher and I was an assistant math teacher. He was new to our school and I got assigned to his class, which he hated because he‚Äôs a nervous public speaker and didn‚Äôt want to be watched. I could tell he thought I was cute. But I could also tell he was never going to make a move. After a few days I moved from the back of the class to the front. I noticed a Big Lebowski sticker on his laptop, so I started asking him about movies. And that worked, because he loves movies. But mostly he‚Äôd just listen. At the time I was dealing with some roommate drama, so I‚Äôd come in every day like: ‚ÄòMy roommate this, my roommate that.‚Äô And he‚Äôd be like: ‚ÄòThat sucks. I‚Äôm really sorry.‚Äô All my other friends were tired of hearing me talk about it, but he never seemed to get tired. And that‚Äôs how it still is, two years later. I tell him everything. Whether it‚Äôs: ‚ÄòOh, this lady bumped into me on the bus and she smelled really weird.‚Äô Or: ‚ÄòOh, I had a really bad day at work and I‚Äôm feeling sad.‚Äô I‚Äôm a yapper. I know this. I love to talk and talk and talk and talk and talk. It‚Äôs something I‚Äôve always been self-conscious about. I know how loud I can be. I know that I go on and on and on, and sometimes it‚Äôs too much. I‚Äôm aware of that. But like, I can‚Äôt stop it. It‚Äôs just what I do. It‚Äôs how I am. And even though I think I‚Äôm pretty smart, I feel like a lot of the time, I‚Äôm maybe viewed as not-so-smart. And I‚Äôd even started to believe that a lot of what I have to say isn‚Äôt important, or maybe it‚Äôs dumber than I think it is. But from the very beginning, when I wouldn‚Äôt shut up about my roommate situation, he just always listened. And he still listens. He‚Äôs helped me feel more brave in using my voice, and more secure in what I have to say. Because he never gets tired of hearing it.‚Äù",
