        "id": "3600502657426123770",
        "type": "Image",
        "shortCode": "DH3jhc0u-v6",
        "caption": "‚ÄúI crashed in college. I‚Äôd been this perfect student all through high school, but then I got dropped into this environment where there weren‚Äôt many Latinos. I‚Äôve always been chubby‚Äî and even though I don‚Äôt have it now, I usually have really curly hair. So I was super insecure. Then at the end of my freshman year, I lost my father and two of my grandparents. Three deaths in one semester. And I just crashed. I didn‚Äôt want to get up in the morning. Didn‚Äôt want to eat. Didn‚Äôt want to do anything. I don‚Äôt want to say I had no power; but I had no energy. Then one day I stumbled across this YouTube video about manifestation. It‚Äôs based on the law of assumption. If you assume you have something, then it will be yours: love, money, confidence, radiance. The first thing I did was assume some things about myself. I made a tape of the same affirmation. It was my own voice, and I just looped it all day long. All of the statements were ‚ÄòI‚Äô statements: ‚ÄòI‚Äôm confident. I‚Äôm beautiful. I‚Äôm smart. I‚Äôm intelligent. I‚Äôm magnetic. I attract good people. I attract healthy love. I‚Äôm enough.‚Äô That‚Äôs what I needed to believe more than anything: that I‚Äôm enough. That I deserve to be here, as in alive. I looped that tape all day long. I slept with it in my ears. And my life was completely changed in a matter of three weeks. I found this group: this amazing core group of people that till this day are my friends. And it was that group of people that changed my entire perception on life. If eighteen-year-old me could see the twenty-five-year-old me, she‚Äôd be amazed. I have my own place. I help my mother out. I help my little sister out. I have two cats. I have an amazing support system. That group of people changed my life. And of course, it was the manifestation that brought me the group that changed my life.‚Äù",
