        "shortCode": "DHB6DQCPq9-",
        "caption": "‚ÄúBeing dependable was a huge part of my identity. I was the pillar: the person that everyone comes to. I never asked for help because I never wanted to seem vulnerable. I was afraid if people saw me vulnerable‚ÄîI wouldn‚Äôt be useful to them anymore. That was my biggest question, like: ‚ÄòWhat is my use?‚Äô I didn‚Äôt know the answer and I was afraid to explore that. But then this one came along, and the gears switched. The big thing was the emotions. It was a whirlwind, for both me and him. There was this one day when he wouldn‚Äôt stop crying. I knew that nothing was seriously wrong, but he just wouldn‚Äôt stop. At the time I was living in California, so I called home. My little sister was the first to pick up. She‚Äôd never even heard me cry before, but I was crying. I couldn‚Äôt speak. I was hyperventilating. She told me: ‚ÄòYou do not need to speak in this moment. I don‚Äôt need to hear anything you have to say.‚Äô It wasn‚Äôt in a dismissive kind of way, more of a: ‚ÄòIt‚Äôs-OK-for-you-to-not-have-all-the-answers‚Äô kind of way.‚Äô Then she put my dad on the phone, and he was like: ‚ÄòCome home now.‚Äô So I came back to New York, just for a couple months. And I‚Äôve been here ever since. My family‚Äôs been taking care of me: cooking for me, everything, the whole nine. And I‚Äôm like: ‚ÄòDamn. This feels good.‚Äô You know‚Äîto recharge. Just to be accepted as I am, with all my weaknesses, or what I thought were weaknesses. I‚Äôve been answering phone calls, which sounds like the smallest thing in the world. But for the longest time I wasn‚Äôt even answering phone calls. It was like: ‚ÄòOh my God, someone‚Äôs calling. They‚Äôre gonna ask me all these questions They‚Äôre gonna know.‚Äô Now it‚Äôs like: ‚ÄòIf I cry on this phone call, it‚Äôs okay. It‚Äôs OK to not be telling people all the grand things I‚Äôm doing. That‚Äôs fine too. They‚Äôll accept me where I am.‚Äô And getting to that place was big for me. Like huge.‚Äù",
