        "shortCode": "DG6V8GZPPhT",
        "caption": "‚ÄúIt‚Äôs not easy, being out of work. I‚Äôve struggled with depression my whole life, and in a situation like this, I‚Äôm highly susceptible to getting depressed. Depression is like a beast; you have to fight it. And I know all the ways to fight it. I‚Äôve been checking out a bunch of new bike paths in the Bronx; my bicycle is my happiness machine. But even when I‚Äôm riding, there‚Äôs this weight on me. It‚Äôs a guilt, like: ‚ÄòAm I doing enough? Shouldn‚Äôt I be at my computer, looking for opportunities? Why can‚Äôt I fucking find a job?‚Äô I was a young manager, a young vice president; I had big departments underneath me. It‚Äôs the world that changed, really. I was an expert at print production in magazines, and that whole industry kinda died. I was able to pivot into leading teams, managing the whole brand, but I‚Äôve been out of work for almost a year and a half now. Not quite, but Jesus. I‚Äôm trying to be comfortable in the uncertainty; I was just reminding myself of that to myself on the subway‚Äîto be comfortable with uncertainty. But it‚Äôs hard. I am very grateful for all the things I have, which helps. My wife is so supportive. When I go on interviews she makes sure that I dress the right way: put on that sport coat on, don‚Äôt wear those boots‚Äîall the shit I usually get annoyed with her about. She‚Äôs worried too. But she‚Äôs never like: ‚ÄòWhat the fuck? You gotta get a job.‚Äô She‚Äôs always saying: ‚ÄòThese places would be lucky to have you.‚Äô I‚Äôve got the greatest kid, too. He‚Äôs my best friend. We‚Äôre both Knicks fans, so when the Knicks are doing well, that‚Äôs fun. He‚Äôs super smart. He teaches me shit, you know? I had a great conversation with him last night. That‚Äôs the thing‚ÄîI‚Äôve always been so good at separating who I am from my work. So it isn‚Äôt an identity thing. It guess it‚Äôs a success vs. failure thing. Success is living the life that everyone thinks I‚Äôm living. And failure is the other thing. Constantly being worried, always fucking behind, feeling like a bad person. It just feels like the life that I‚Äôve been able to put together is on thinner and thinner ice. I just have to get a fucking job.‚Äù",
