        "shortCode": "DF8VOa4PoAr",
        "caption": "‚ÄúIt was the day my mom‚Äôs lights got cut off. She tried to light candles and the apartment almost burned down. That‚Äôs the day my grandparents were like: ‚ÄòYeah, no more.‚Äô I was nine years old at the time, and I went across town to live with them. It was a small town: Rocky Mount, North Carolina. Think: church, fish fries, and southern food. My grandparents had a three-bedroom house painted red, white, and blue. Everyone on the block knew my grandfather. He was very community-minded: we stayed two houses down from a drug dealer, and for Christmas my grandfather bought the drug dealer‚Äôs kids toys because they didn‚Äôt get anything. My grandfather was a deacon at the church, he was friends with the sheriff. He did not play around about disrespecting elders. I had to wake up every morning at 5 AM: get dressed, make my bed‚Äî those were the rules. And at 6 AM I had to be at the table, because that‚Äôs when breakfast was served. Jacquelyn Grant was not going to get in trouble, period. He always told me: you only get one strike. You‚Äôve already got one because you‚Äôre black, and another because you‚Äôre a woman. So there can‚Äôt be any more strikes. Every day I had to come straight home after school. If I was grounded, it wasn‚Äôt for a few days. It was for a month. I got wild in middle school. Fighting and everything, it was ugly. I don‚Äôt know what happened. I think I was just angry. One day I got suspended for fighting, and when I came home my grandfather was so upset, he was like: ‚ÄòWhere did I go wrong with you?‚Äô I talked back that day. I said: ‚ÄòIf you know so much about life, how come you‚Äôre still living in Rocky Mount?‚Äô It was the first time I‚Äôd ever seen my grandfather cry. He gave me a history of the neighborhood. A railroad track ran through town: the rich people were on one side, and we were on the other. ‚ÄòBut it didn‚Äôt used to be like that,‚Äô he said. He told me about white flight. He said: ‚ÄòI could have left when things got bad, but I didn‚Äôt want to leave my community. I worked for this community. I worked for this house. This is my house, so I‚Äôm not leaving. And let me ask you something, Jacquelyn‚Äî ‚ÄòIf I had left, where would you be today?‚Äô‚Äù‚Å£\n‚Å£\n[Part Two in comments]",
