        "id": "3571489815045606378",
        "type": "Image",
        "shortCode": "DGQexBwuAvq",
        "caption": "‚ÄúIt didn‚Äôt hit me until she was coming. I swear, I was fine. I actually helped deliver her. It was just me and the nurse until the very end; I was the one holding my wife‚Äôs leg up. But when the baby started coming out, I mean‚Äî not just the head‚Äî but fully coming out, it hit me like a ton of bricks. I started getting hot flashes. I had to sit down and put an ice pack on my head. I think it was just the weight of it all. Not a scary type of weight, but the anticipation had just been so huge; it‚Äôs something I‚Äôve been wanting for a long time. She‚Äôs three weeks old now. I‚Äôve been lucky to take off work and get that time in when she‚Äôs brand new, when she‚Äôs just‚Äîhere. You know? There‚Äôs been a lot of sitting on the couch. A lot of TV. We‚Äôve ordered a lot of food. A lot of changing diapers, a lot of holding her. It‚Äôs fucking wild, holding her. I just stare at her. I don‚Äôt know what else to do. I just stare at her with amazement‚Äî thinking about how she‚Äôs going to grow up, and we get to be there and watch it. She already has her own independence. The nurses told us she was self-soothing that very first night at the hospital, so she already knows how to take care of herself. She doesn‚Äôt even like the binky. So, you know, I hope she keeps that part of herself. She‚Äôs also a little bit of an animal. She likes to growl and bite when she‚Äôs feeding. She‚Äôs ferocious, you know? I hope she takes that with her too.‚Äù",
