        "caption": "‚ÄúBack in the eighties dungeons were becoming a thing in New York. Guys would pay a lot of money to come there and have some dominatrix tell them what to do. I was making leather pencil skirts for a lot of the doms, with holes in the back so that guys could kiss their ass. One day I was fitting a dom named Asia, and I told her: ‚ÄòI bet I could make more money than you without wearing stuff like this.‚Äô She bet me I couldn‚Äôt.  It was all a big goof. But then I started really thinking about it. Asia was making $150 a session, and that was real money.  So I did the same thing I always do when I get an idea. I just ran an ad in the back of the Village Voice. Most of these girls were advertising how young they were. So I used the word ‚Äòmature.‚Äô And I figured out how to write ‚ÄòJewish Guys Welcome‚Äô in Yiddish, and I put that at the bottom. It was some of the easiest money I ever made. I never let them touch me. All I had to do was be a bossy black woman. And I could do that easy because my mother had been such a bitch. I‚Äôd pretend to be a school teacher, or a nanny. It was the dumbest shit. I just kept inventing crazy scenarios. And the crazier the scenario, the more money I made. One time I heard about a dom on the Upper East Side who charged $3,000 a week to kidnap a guy and lock him in her basement. I didn‚Äôt have a basement, but I knew a limo driver named Dean who liked to hustle like me. So every time I got a call from a new client, I‚Äôd say: ‚ÄòYou want to be kidnapped, don‚Äôt you?‚Äô And he‚Äôd start stuttering like: ‚ÄòDuh, duh, duh, duh.‚Äô And I‚Äôd say: ‚ÄòListen to me closely. Stand on the corner of 5th and 18th tomorrow at 3 pm. Don‚Äôt be late.‚Äô Then I‚Äôd call Dean and tell him the plan. It was always easy to spot the guy. He‚Äôd be the one checking his watch and looking scared as shit. So we‚Äôd roll up in the limo, grab him by the collar, and pull him inside. Then I‚Äôd lock the doors and start telling him what to do. Everything went down in the back of the limo. Dean just rolled up the partition and kept his eyes on the road. At the end I‚Äôd give him $100, because I was getting $250 for that.‚Äù",
