        "caption": "‚ÄúThose first songs were bad. I was doing random covers and trying to rap, but the rap wasn‚Äôt even honest. I was lying. Then suddenly I‚Äôm out of high school, and I‚Äôm an adult, and it‚Äôs like: ‚ÄòOh, I have to pay bills.‚Äô My friends started graduating from college and getting better jobs, and you know, I‚Äôm still doing the dream. It‚Äôs like: ‚ÄúOh shit, did I fuck up?‚Äô There was a point when I was twenty-one that I was sleeping in my car. I had nowhere to stay and I was too proud to ask for help. I tried to de‚Äëalive myself that year. I just felt so alone: I‚Äôd stopped making music, I didn‚Äôt even care about my art. I tried working as a party promoter for a while, then a couple years ago I took a job as a janitor. One of the buildings we cleaned was the Universal Music Group building. That was cool; I‚Äôd see all these famous artists and producers. But then I‚Äôd go clean 40 bathrooms in a finance building. That was a low, honestly: Looking at a guy that‚Äôs the same age as you and has this great finance job. He‚Äôs living the best possible outcome of what a twenty-something can be, and he just shit. And now I‚Äôve got to clean that shit. For $18 an hour. It almost would have been better if these guys were mean, but they‚Äôre not. They‚Äôre like: ‚ÄòSorry, bro.‚Äô That‚Äôs when I said: I‚Äôm going to take one last stab at it. If it doesn‚Äôt work, it doesn‚Äôt work. It‚Äôs funny, because the song that popped off is quite literally about not quitting your dream. It was only like the twentieth thing I posted on TikTok. I was feeling really emotional that night, and I think people could feel it. The song got like 125,000 views, and it must have gotten on some list. Because the next thing I know, every A&R person in the industry is DMing me and finding my phone number. I flew to Atlanta and L.A. I even did three meetings in the UMG building. The doorman thought I was showing up for work. In June I ended up signing a contract with the same label as Billie Eilish ‚Äîno songs out yet. I‚Äôve still got to figure out how to put together an album. There‚Äôs still a long way to go, and it‚Äôs all still so new. But at least for now I get to be an artist full time. I finally have a little freedom to do what I love.‚Äù",
