        "shortCode": "DFAvt2UukOz",
        "caption": "‚ÄúI‚Äôm teaching my last class in a few hours. I‚Äôve been a professor of textile design for twenty-something years, but it‚Äôs sort of on an ‚Äòas needed‚Äô basis. And there‚Äôs been a decline in enrollment, so I don‚Äôt think I‚Äôm needed anymore. I‚Äôll have to figure out what else to do with my time. I don‚Äôt want to just start binge-watching Netflix. I could always go work as a receptionist somewhere. But I‚Äôd like to think I have something particular to express, and that if I pour my energy into it, and I‚Äôm disciplined enough, then something will come out of it. But it takes bravery to be creative, right? You know, you look at Pinterest or whatever, and it looks like everything‚Äôs been done already. It‚Äôs easier to find the confidence when you‚Äôre 25, or 35, or even 45; you can kind of convince yourself that you‚Äôre cool and hip and, you know, of the moment. If I was still in my thirties maybe I‚Äôd invest in going to art school or something. But at this age, it‚Äôs kind of like: is that really worth the investment? At an age where most people are thinking of retiring? It‚Äôs a question of time. Because how many more years do I have of actually working, creating? But also, it‚Äôs a self-worth question. If I do a two-year degree, I‚Äôm almost sixty. If I do a four-year degree, I‚Äôm definitely sixty. You worry about investing all that time, all that money, all that energy. And then kind of being mediocre, you know, at that thing. And that would be hard to swallow at this age, right? You kind of want to finish on top.‚Äù",
