        "type": "Sidecar",
        "shortCode": "DEsVGGNumSx",
        "caption": "‚ÄúTimidity. Timidity is the best word for it. I‚Äôd never had a girlfriend. And I couldn‚Äôt stand up for myself. Whenever someone spoke with a little more confidence than me, I‚Äôd just assume they were superior and back down. I still had a sense of self-worth. I‚Äôd get angry if people pushed me. But I could never direct it; it would turn into tears. There was just this intense dissatisfaction with my life and a feeling that I needed to change. Then one day I was walking through Harlem and I passed a dojo; inside there were these guys in full armor. They were hitting each other with blunted weapons. This wasn‚Äôt stage-fighting, it was full-contact. The sparks were flying: boom, boom, boom. I‚Äôve always loved the Middle Ages, and I‚Äôd done some fencing in college‚Äîso I decided to give it a try. I was useless at first. The armor is a shock to your system. There‚Äôs this thing called helmet horrors, when your brain starts to tell you that you‚Äôre suffocating to death. So it took me awhile to learn to breathe. And of course I was way too timid. After one practice a Ukrainian guy started screaming in my face, saying I was useless. I started crying in front of everyone. Because I knew that he was telling the truth. I could have quit right then, but instead I made the decision to change. I stopped worrying about getting hit. I realized: I‚Äôm wearing steel armor, it‚Äôs not going to hurt me. I became more explosive. Our next match I actually took some people down. It‚Äôs the first time I felt like I contributed, and that started a sort of feedback loop. It‚Äôs not that I won every match. But I went into every match believing I had a chance to win. After the Carolina Carnage tournament our team captain sent a message to the entire group chat. I still have it on my phone. He said: ‚ÄòI want everyone to look at Marco. He has changed more than I‚Äôve ever seen anyone change.‚Äô It even spilled over to my normal life. I started standing up straighter, dressing better. When I first met my fianc√©, there were all these roadblocks. All these mixed signals that I previously would have taken as rejection. But I was persistent. It‚Äôs like: ‚ÄòWhat‚Äôs the worst that can happen? I‚Äôve been hit with an axe.‚Äô‚Äù",
