        "type": "Sidecar",
        "shortCode": "DEiQ9pgvYAs",
        "caption": "‚ÄúI was angry with him for a long time, until super recently. It‚Äôs only been in the past two months or so that I‚Äôve decided I haven‚Äôt been giving him enough love and respect. He came to America with no money, barely speaking English. He wasn‚Äôt able to attend school himself. He didn‚Äôt want me enduring those same hardships. He told me so many times growing up: ‚ÄòEverything I‚Äôm doing is for your good.‚Äô But he was really strict. I don‚Äôt know how to better explain it: he told me what to do, and I had to do it. A lot of kids would hang out after school, go to the mall. I never had that social interaction. All I did was stay at home and study. Cello was a big reason for the rift that developed between us. My dad was my private teacher, and he started my lessons around the age of five. It quickly ramped up to multiple hours a day. It was really painful, but he made me practice so much that I became one of the best cello players in the country. I got into a great school. But as soon as my college acceptances arrived, I quit. Because I didn‚Äôt feel the need to do it anymore. Everything in my childhood, everything I did growing up, was purely to be put on a college application. Now that I‚Äôm in college I‚Äôm learning that there are a lot of other ways to live. I‚Äôve been trying hard to talk to a lot of people. How we‚Äôre talking, right now? Two years ago, I‚Äôd never have been able to do this. But I‚Äôve put a lot of effort into it. These past few months I‚Äôve gotten really into raving. A lot of these big artists have super large Asian fan bases, so I feel that I can connect pretty easily. I‚Äôm not as loose as other people, because I go sober. But I‚Äôm trying to loosen up. Which for me, right now, involves putting my hand up and jumping around.‚Äù",
