        "caption": "‚ÄúI just want to be a single guy. That‚Äôs what he told me. It was over the phone, because I was out of town. Then I had to come back and help him move. We‚Äôd been married for ten years. And I had to move out all this furniture that I‚Äôd connected to our home and our marriage. It wasn‚Äôt the best way for him to do it. He was going through some things; we were struggling financially. But yeah, it wasn‚Äôt the best way. It‚Äôs brought up some youthful trauma. I didn‚Äôt come from a nuclear family, so there‚Äôs some abandonment issues. And it‚Äôs like I‚Äôm feeling the sting of puberty all over again. Maybe if I was prettier, he‚Äôd still like me. Maybe if I could keep up with him athletically, he‚Äôd still like me. But it‚Äôs only been three months. I don‚Äôt feel like there‚Äôs a stamp on it, not yet. No matter what the papers say. He‚Äôs still the love of my life. In my head I‚Äôm thinking: maybe this is a space of time where I can work on myself, and I‚Äôll get him back. It‚Äôs hard to not reach out. But I‚Äôm being strategic. You know, showing him I‚Äôm a big girl. In the meantime I‚Äôm trying to fortify myself. I came up with that, by the way: ‚ÄòFortify myself.‚Äô I didn‚Äôt hear it on any podcast. I came up with that by doing my own trench work. I‚Äôm trying to hold myself accountable to the people I see every day, which is myself. And that‚Äôs the hardest person to be accountable to. Did I honor myself yesterday? Did I make plans for myself tomorrow? Can I still love myself in the present, even if right now I don‚Äôt look like the ideal version of myself? I have this app called Finch. It gives me goals, things like: get out of bed, wash your face, make a meaningful connection with someone. I‚Äôve struggled with depression, still do probably. Last night was difficult. But I‚Äôve managed to not fall into any self-destructive habits. Growing up as a teen, someone who is big boned, you collect all these self-destructive habits. And I haven‚Äôt been self-destructive. I‚Äôve being going to work. And I‚Äôm not crying. Aren‚Äôt you proud of me?  I‚Äôm not crying. Am I ready to be alone? That‚Äôs a deep question. I don‚Äôt want to wrestle with that demon, not yet. But in the meantime, fortifying myself. Fortify, fortify. Yeah.‚Äù",
