        "caption": "‚ÄúMy father and I don‚Äôt get along. Don‚Äôt get me wrong‚Äî I love him, he loves me. But I was a spoiled kid. To be honest with you, a spoiled brat. If our neighbor was driving a Mercedes, I would not accept a Volkswagen. I won‚Äôt eat no food, I won‚Äôt go to school, until I get a Mercedes. I‚Äôm 31, right? Until now, I have literally destroyed‚Äî four, five, six, seven‚Äî eight cars. Eight cars in accidents, like you see in movies. Drifting and all that shit, I can do that in real life. But my family is very different than me. We come from the state in India where Gandhi was born. My parents are very religious; they‚Äôre Jain. These people believe that every organism in this world deserves to live. No eggs, no meat. My mom does not even eat onions. My father makes a lot of money; but he does not spend it. Just gathers, gathers, gathers. What is the point of that? Myself, I am a very materialist person. I love myself more than anybody else in this world. If I had a boat with my family, my friends, and I could only save one person, it will be myself. That‚Äôs how it‚Äôs supposed to be for everybody. Because if I lost everything, I have the ability, I have the spirit in me, to get it back again, again, again. I lost like $3.5 million at a very early age, right? I don‚Äôt care. I‚Äôll make it again. And when I‚Äôm making money, I will spend it. You see these Michael Kors, what do you call them: sneakers? I pay like $400, $500 for that. But I‚Äôm not showing off, I‚Äôm a Leo. And Leo isn‚Äôt ruled by a planet, it‚Äôs ruled by a star. The sun. The sun is the center of everything, so Leos need the best of everything. They do not want to dominate anybody. But when I walk in, people feel like I‚Äôm trying to be better than them. You would feel it yourself. Even if I don‚Äôt say anything, you would feel I‚Äôm arrogant. But I‚Äôm not arrogant. I‚Äôm a sweetheart.‚Äù",
