        "inputUrl": "https://www.instagram.com/humansofny/",
        "id": "3525270806932072473",
        "type": "Video",
        "shortCode": "DDsRx8IPagZ",
        "caption": "BEST UPDATE EVER! Most of you will remember our beloved Mary O‚ÄôHalloran of Mary O‚Äôs Irish Pub. During the pandemic she rescued herself, her pub, and her family from the jaws of eviction by baking and selling her mother‚Äôs Irish Soda Bread scones. Mary‚Äôs family of regular customers did everything they could to promote the scones. Humans of New York was not the first to answer their call. No, that honor goes to Roger Clark of NY1 News, hallowed be thy name. But the HONY community followed close behind, and we came in hard. You kept ordering, and reordering, keeping Mary afloat‚Äî both economically and spiritually‚Äî for years. But Mary‚Äôs ten-year lease on the pub ends next year. With the way rents are rising, this almost certainly meant the end of Mary O‚Äôs Irish Pub.‚Å£\n‚Å£\nBut Mary had a crazy idea. She was going to rent ANOTHER store, for the sole purpose of selling scones. Here I must shamefully admit: I told her not to do it. Mary is a giant in the Heart Department, and a giant in the Faith Department, but she is a bit deficient in the Accounting Department. I told her to focus on selling online. ‚ÄòMary,‚Äô I said, ‚ÄòYou cannot handle the stress of paying rent on two storefronts in NYC.‚Äô But thank God Mary does not listen to anyone. She opened Mary O‚Äôs Irish Soda Bread Shop about a month ago at 93 East 7th Street, in the heart of the East Village. And I‚Äôve never seen anything like it.‚Å£\n‚Å£\nEvery day the line is further out the door. Mary O‚Äôs Irish Soda Bread shop is taking the city by storm. No marketing. No business plan. Just the perfect scone, and a hardworking mother-of-six that everyone seems to love. Anyway, let‚Äôs all do our part to fan the flames of this wildfire. Visit the shop. Spread the word however you can. And if you‚Äôre one of the thousands who have tasted these impeccable scones, give the store a review on whatever platform you can. Long live Mary O‚Äôs Irish Soda Bread Scone Shop! Long live Mary O‚Äôs Irish Pub! And long live Mary O! (Special thanks to the lovely @sistersnacking, who were early scone adopters, for allowing me to use their beautiful close-up scone footage.)",
