        "shortCode": "DDXuePFPeHL",
        "caption": "‚ÄúIt‚Äôs hard for me to feel sad that the CEO was killed. I‚Äôm in social work. So many of the people I see who are homeless have similar stories: they got a debilitating illness, which caused them to go bankrupt, or get addicted to drugs. Meanwhile these health insurance companies are profiting from people not getting the care they need. Millions of people suffer from that behavior. Where is the justice for those people? Maybe violence is never the answer. But this isn‚Äôt a question of morality to me. It‚Äôs a cause-and-effect thing. This is what happens when people aren‚Äôt being heard. The system isn‚Äôt working. This is where the government was supposed to step in, but it didn‚Äôt. And millions of people were left with nowhere to turn. I‚Äôm uncomfortable that violence was used. But also, it‚Äôs nice to finally have some pushback.‚Äù",
