        "id": "3278751380938730881",
        "type": "Image",
        "shortCode": "C2AdwJnrK2B",
        "caption": "‚ÄúOccasionally I‚Äôll have a beer after work and break out the sketchbook. But I had wanted to be this great painter. I wanted to do these grand things: big, huge oil paintings. But those days of painting all the time were such a roller coaster. There were these periods of extreme depression, followed by manic states of trying to put myself out there. I couldn‚Äôt do it anymore. I mainly felt sorry for my dad. I know it was rough for him. My mom hadn‚Äôt wanted me to go to art school. She wanted me to do something more practical, but my dad said: ‚ÄòNo. This is what he wants to do, and I want to support his dream.‚Äô And then I abandoned it. That was the first time I had to deal with real failure. A lot of times when you‚Äôre an artist‚Äîit‚Äôs your job, it‚Äôs your lifestyle, it‚Äôs your entire fucking identity. It wasn‚Äôt like I failed to do a thing. It was like: I failed to be something, you know? It was a failure to live up to what I thought was my destiny. But then on the other side of that-- there was this figuring out that there was nothing wrong with me the entire time. I didn‚Äôt need to be something else to have meaningful friendships, or a good relationship. I didn‚Äôt need to be something else to be loved and cared about. After work tonight I‚Äôm going to meet up with a person who‚Äôs in love with me, and I can‚Äôt wait. And that person met me long after I gave up on being a full-time artist. They met me when I wasn‚Äôt even a chef yet. I was a piss-poor, part-time line cook. But even then-- they decided I was worth it. So you know, there‚Äôs something there. There‚Äôs something there that‚Äôs enough.‚Äù",
