        "caption": "‚ÄúIt‚Äôs a love/hate relationship. Hate is too strong a word. But she just can‚Äôt accept that I‚Äôm not a kid anymore. I‚Äôm a lot more mature than most fourteen-year-olds; I already have a job and everything. But she‚Äôll shut me down just to get at me. And there‚Äôs nothing I can do because she‚Äôs my Mom. She‚Äôs always on top of me: be careful with this, be careful with that. Won‚Äôt let me go to my friend‚Äôs houses if they‚Äôre a little further than our neighborhood. And we‚Äôre both stubborn, so if I try to argue it goes back and forth. She doesn‚Äôt want to see her kid be right. She gives me no choice but to be loud and extreme just to get my point across. But look, I get it. She‚Äôs got this Google folder on her phone with like 1400 photos of me when I was younger. It goes all the way back to my first day of school. The other day I went into the kitchen to get a drink, and I caught her scrolling through the pictures, and she‚Äôs crying. I was like damn. So look‚Äî I get it. I‚Äôm still mad, but I get it.‚Äù",
