        "shortCode": "C2iMgsWu57N",
        "caption": "‚ÄúWe‚Äôve been dealing with invisibility. We started realizing we‚Äôre kind of fading. So many of our friends say that: that they‚Äôre becoming invisible. Everybody needs a welcome from somebody else so that they can feel useful. It‚Äôs a real source of energy. And when you realize you‚Äôre not getting that as much‚Äîwhat happens is you get scared. And you also say: maybe we could do something a little different. So at some point we came up with the idea of the cute older couple. We were hoping to find some younger friends. We‚Äôve always been attracted to younger people. You know, young people struggle. So we like to support them and wish them well and give them a lot of approval. And young people need cute old couples. They love cute old couples. So we decided to play it up a little bit. That‚Äôs what it is: ‚Äòplay.‚Äô It‚Äôs really play. Have you ever seen two dogs greet each other? One dog will drop down, and bam, suddenly they‚Äôre playing. I think that‚Äôs what we‚Äôre doing. We‚Äôre inviting a play response.‚Äù",
