        "shortCode": "C1ufNp1LiEa",
        "caption": "‚ÄúJust the other day a video popped up on Facebook. It was only five years ago. We were in the park. I was pushing her on the bike, letting go. We used to have so much fun together. We‚Äôd always get ice cream. She‚Äôs a strawberry girl. I‚Äôm a vanilla guy. Chipwich, actually. I‚Äôm a Chipwich guy. She‚Äôd give me a hug afterward, tell me I was the best dad ever. We were such good friends. But now it feels like we‚Äôre so far apart. She doesn‚Äôt want to talk to me anymore. Even when she‚Äôs upset, she‚Äôll ignore me and go to her room. It‚Äôs like: C‚Äômon. I was fifteen too. I know what it‚Äôs like. But she‚Äôll come back, I know that. They always come back. But it does feels like you‚Äôre getting your heart ripped out a little bit.  But look, I get it. She‚Äôs figuring out life. You have to back off. You have to give them space. Cause if you charge after them and get all aggressive about it, you might push them away forever. But they always come back, right? One day she‚Äôs gonna realize that I‚Äôm not the enemy and I‚Äôm really her dad, her friend. I still get a flicker of it, every once in awhile. We had a really surreal moment last year. Her birthday is March 17th. She‚Äôs a St. Paddy‚Äôs Day birthday. We always take her to a Spanish restaurant on Long Island, but this time we did something special. Her uncle used to be a bodyguard for Taylor Swift, and we still know some people at the company. So they got us tickets to her concert. Fifth row seats. I mean, don‚Äôt get me wrong. We paid for them-- but fifth row center. She was crying. I got a big hug. A big kiss. A ‚ÄòThank you, Dad.‚Äô It wasn‚Äôt ‚ÄòYou‚Äôre the best dad ever.‚Äô But it was a really big: ‚ÄòThank you, Dad.‚Äô‚Äù",
