        "shortCode": "C1sKEYxu-_m",
        "caption": "‚ÄúI‚Äôm taking a break from school until I figure things out. I guess I have rebel traits. There were just so many things that felt out of my control, and it bothered me. You have to wake up at this time. You have to go do this. You have to go do that. It‚Äôs like I didn‚Äôt have any originality. There was a certain point when I realized that everything-- this whole routine that I had, had been given to me by other people. And the weird thing is‚Äîwhenever you try to remove yourself from that equation, and stop doing what other people want, you kind of get ostracized and outcast. That‚Äôs kinda what happened to me. I have a great family, but it‚Äôs full of strong personalities. I had so many people telling me: do this, do that. They said it was a ‚Äòrespect‚Äô thing. You know: ‚ÄòI‚Äôm the adult, so you should respect me.‚Äô But I never understood that. Because at what age do I get this thing called respect? Nobody in my family could ever answer that question. Is it when I have a kid? Is that it? Or is it when I'm paying a certain amount of bills? At what point do I step up on the pedestal?‚Äù",
        "hashtags": [],
        "mentions": [],
        "url": "https://www.instagram.com/p/C1sKEYxu-_m/",
        "commentsCount": 1190,
