        "caption": "‚ÄúYou‚Äôre a slut and a whore for the algorithm. I couldn‚Äôt do it anymore. You can never feed it enough. You start out making art, and hoping that the door will open. You‚Äôre looking for that viral moment so it opens up the door and you can do the thing full time. But you start to compromise just to get the door to open: guessing what it wants, debasing yourself, alienating yourself. Until you‚Äôre not even in service to your art anymore. You‚Äôre in service to the algorithm. Deep down every artist just wants to be seen. Everyone does. And that‚Äôs how it controls you. The algorithm makes you behave in a certain way, create in a certain way, in exchange for being seen. And if something can change what you do, it can change who you are. And I didn‚Äôt sign up for that. I didn‚Äôt sign up to become a content creator. Art was supposed to be a way for me to be in search of, in service to, in community with. It was my ministry. Art was supposed to be my ministry.‚Äù",
