        "caption": "‚ÄúI‚Äôm turning forty in August. Three kids, full time job. All my kids are under the age of seven. The amount of mental energy it takes, you know, juggling all of them and the constant questions about nothing. I mean, mom is busy, please, just give me a second. My husband tells me that it‚Äôs just the season we‚Äôre in. We‚Äôll get back to it. But I just want it to slow down so I can pause and breathe. Everything just changes so fast, you know? When you‚Äôre a little kid, and you turn into a teenager, it‚Äôs like: ‚ÄòOh, I‚Äôm changing now.‚Äô But you‚Äôve been coached. You‚Äôre prepared for it. Then you go from teenager to college. That‚Äôs a big change. Then from college into your twenties, still changing. But at some point you kinda feel like I‚Äôm an adult, and I‚Äôm done. But you just keep going. It‚Äôs like oh shit, no, no, I‚Äôm going to keep changing. And these aren‚Äôt like the earlier changes. These aren‚Äôt the ones you get to plan for. Well some of them are, like: ‚ÄòWe‚Äôre moving to a new place.‚Äô Or ‚ÄòI‚Äôm going to get a new job.‚Äô Those you can be ready for. But as you get older shit starts getting thrown at you that you're not planning for. Dodgeballs. And you‚Äôve just got to pivot. And all of the sudden you realize-- that moment in time, right before the dodgeball-- that was the last time you saw the old you. And you didn‚Äôt even get to say goodbye.‚Äù",
