        "shortCode": "CyTU1U6uk2P",
        "caption": "‚ÄúPicture it, okay? Mardi Gras. New Orleans. Bourbon Street.  I‚Äôm on college break with my three best childhood friends. Zak is there with his parents. He‚Äôs got his mom and dad with him. So it‚Äôs two different vibes, but somehow we all end up on the balcony of the same bar. Everyone‚Äôs got beads in their hands. We‚Äôre all yelling to see boobs. Well, I‚Äôm yelling to see boobs. That was just me. But Zak had a perfect mustache. He used to grow it much longer and curl it with wax. And I normally don‚Äôt approach people, I‚Äôm not that person. But his whole family seemed cute. They didn‚Äôt seem like normal New Orleans vacation people. So I was like: ‚ÄòCan I take a picture with you?‚Äô Then we ended up adding each other on Snapchat, because that was the thing back then. And we agreed to meet up the next day after his family was done with their gator cruise and I was finished visiting the strip club. That night we walked along the river until the sun came up. I remember doing handstands on the levees. Then at the end we kissed. It was just a kiss because I was leaving early the next morning, and honestly I thought that would be the end of it. I thought for sure I was never going to see this kid again. But we kept talking, and two weeks later I‚Äôm taking his virginity in a Las Vegas hotel room. There was something going on with his stomach that day. Right when we finished he went to the bathroom and started throwing up. I called my girlfriend and said: ‚ÄòI don‚Äôt think he likes me.‚Äô But it‚Äôs been love ever since.‚Äù",
