                "id": "18002093354490792",
                "text": "I connect with this story so much. When I was in undergrad at my advisor (who also was the department chair) said literally the same thing of my 50+ page capstone project ‚Äî but in Spanish ‚Äî esto es un trabajo al nivel graduado! We were given a 7-10 page limit, but she always told me I could write as much as I‚Äôd like and she‚Äôd read it (on every written assignment). She went on to ask me if I‚Äôd considered grad school; and to be honest I had no concept of grad school, just ‚Äúcollege,‚Äù as a first-gen college student. Her encouragement (and insistence) pushed me to apply for a masters program at @uconn, where I was awarded a full tuition scholarship ü§åüèæ One never forgets something like that; I‚Äôm sure it influenced and influences my work as an educator! I‚Äôm forever grateful to Dr. Mar√≠a-Lu√≠sa S√°nchez. Thanks for sharing this! ‚ù§Ô∏è",
