        "shortCode": "CxT-MGqNJ_Y",
        "caption": "I want to begin by thanking Parviz Zafari. Though it seems strange to say his name, because I‚Äôve only ever heard him called Bubjan, which means Grandfather. When I met Bubjan I only intended his story to be a single post. But as his life began to unspool before me, putting his soul and wisdom into a story became a mission for me. I‚Äôve never met a man who so lived what he believed. You‚Äôve been a great teacher to me, Bubjan. Thank you for showing me that truth is something you do. ‚Äâ\n‚Äâ\nThank you to my close friend @rostamzafari. It was his devotion to his grandfather that sparked all of this. I joke that he dragged me into his house and sat me at Bubjan‚Äôs feet. Rostam would also serve as interpreter for all 100 hours of interviews. Rostam is one of the most brilliant, talented, and ethical people I‚Äôve ever met. He is very much like his grandfather, only he took his love of Shahnameh a step further by tattooing scenes from the book all over his body. ‚Äâ\n‚Äâ\nI want to thank the entire Zafari family: every member played a part in this. Mitra, you are the sun. Thanks to Sepanta Mohseni for holding us together. Thank you to Dr. Maziar Zafari, who I call ‚ÄòThe General.‚Äô He was a chief advisor to the whole project and ripped my drafts to shreds until all the history was correct. We locked horns a few times, but we are better friends because of it. And the story is certainly better because of it.‚Äâ\n‚Äâ\nThank you to Azadeh Vatanpour and Rashid Fani, for creating a translation so good that it was often referred to as the ‚Äòoriginal Farsi version.‚Äô (With an assist from Dr. Zafari.) Thank you to my agent Brian DeFiore, first and last fingerprints on all my stories. Thank you to my beautiful wife Erin, for loving me despite my obsessions. Thank you to everyone who supports Humans of New York on Patreon‚Äîyou are the reason I have the space and time to do this work. ‚Äâ\n‚Äâ\nThank you to the God of Soul and Wisdom, as God is called in this story. Do the next good thing, a way appears. Thank you to Mahsa Jina Amini and the women of Iran, you continue to inspire us. ‚Äâ\nAnd lastly, thanks to all of you who read these stories. Sharing them continues to be the great privilege and joy of my life.",
