        "caption": "(24/54) ‚ÄúOne afternoon the empress and prince attended a session of parliament. It was an important day. Everyone was hoping to make a strong impression, and I‚Äôd prepared a speech especially for the occasion. I was the last speaker on the schedule. The Speaker of Parliament saw me approaching the podium and tried to wave me off. When I kept coming, he hurriedly adjourned the session. I think some of my colleagues viewed me as an annoyance. I‚Äôd developed a reputation for speaking my mind. And whenever I could speak, I spoke. I gave a speech on every budget, every proposal, every vote. The topic was always different. But the theme was always the same: ùòãùò¢ùò¢ùò•. Justice. The word that appears most in Shahnameh. Everyone gets what they deserve. One day I gave a speech saying I‚Äôd been informed that Iran‚Äôs highest-ranking admiral had used a battleship to import Italian furniture. I asked how we could allow such corruption, from a man with a breast full of public service medals. The crowd was silent. It was unheard of to criticize the military, because it was in the hands of the king. But I wanted to show that I was not afraid to speak. So that other Iranians would feel free to share their thoughts. My words were never heard in the media. If there was ever a mention in the newspaper, it would only say: the representative from Nahavand gave a speech. But still, I spoke. I always had hope that I‚Äôd find a way to be heard. There is an Iranian proverb about ‚Äòwords that fly.‚Äô It says that if words are false, if they are self-serving, if they come from ambition: they will never fly. Even if they‚Äôre shouted from loudspeakers. Even if everyone says them at the exact same time: they will soon be forgotten. For they have no soul. They have no ùò´ùò¢ùò¢ùòØ. But if a person can find the right words. If the words have ùò¢ùò©ùò¢ùòØùò®, if the words have ùò¨ùò©ùò¶ùò≥ùò¢ùò•, if the words have ùò≥ùò¢ùò¥ùòµùò™-- they will grow wings. And they will fly. Even if they‚Äôre censored; they will fly. Even if they are silenced; they will fly. Even if they are buried deep in the ground; they will still fly. And they will reach the doorstep of every household.‚Äù",
