        "shortCode": "CxI9ePZLKYu",
        "caption": "(22/54) ‚ÄúDr. Ameli was elected to parliament in the same election, and was chosen by his peers for a leadership position. He was a unifying figure. A man without enemies. His words never cut. He attacked philosophies; never people. And he was one of the best speakers in parliament. He didn‚Äôt use slogans. He spoke with depth. And somehow, no matter how specific the policy, or how divisive the issue, he always came back to a place of unity. Our common destiny as a people. On the morning our first budget was presented Dr. Ameli approached me in the halls of parliament. He asked if I planned to give a speech. I told him I did not, because I had no specific objections. He leaned close to my ear, and with a soft voice he said: ‚ÄòStill, you must speak. To separate yourself from the system.‚Äô That night I slept on a rug on the floor of parliament, and first thing in the morning I placed myself on the calendar of speakers. When my turn came I walked down the aisle toward the podium. My knees felt weak. There is a magnitude to speaking in parliament, a consciousness of history. I‚Äôve never been a natural speaker. I‚Äôm never one chosen to give a toast at parties. But if I believe a statement is true, I can say it. No matter how big the stage. Truth has power. Truth has a force. ùòïùò™ùò≥ùò∞ùò∞. It doesn‚Äôt come from the tongue, it comes from within. And the moment I take my place at the podium: it‚Äôs like a spring has been sprung.  That day I spoke about justice. ùòãùò¢ùò¢ùò•. I said that justice in society begins with justice in our budget. There was a proposal in the budget to build a new telephone system in one of Tehran‚Äôs nicest neighborhoods. I reminded the parliament that there were entire villages without a single phone. I said: ‚ÄòBefore we give the wealthy a phone by every bedside, let us give a phone to every village.‚Äô It was one of the most forceful speeches I‚Äôve ever given. But there was no mention in the media; criticism of the government was not allowed. I at least wanted a copy for my own records. There was a person in parliament who transcribed everything, so I asked them for a copy of my speech. But they told me it was not allowed. They wouldn‚Äôt even give me my own words.‚Äù",
