        "shortCode": "CxJdrTvrA9u",
        "caption": "(27/54) ‚ÄúOne morning I was called into the Speaker‚Äôs office along with another colleague. We were told that he‚Äôd received a call from the king‚Äôs office, and the king needed our two votes on an upcoming issue. My colleague was silent. But I replied: ‚ÄòI cannot do it. If I was a soldier of the king, I would crawl across the floor at his command. But I am a representative of the people. And I answer only to them.‚Äô When I looked over, my colleague had tears in his eyes. Nobody disobeyed a direct request from the king. But Iran was a constitutional monarchy. We had a constitution. That was supposed to mean something. It had to mean something‚Äîor we were left with nothing but a king. I knew I wasn‚Äôt helping my career. The parliament was a corrupted system, and the only way to advance was to support the king. But I wasn‚Äôt there to be part of the system. I was there to scream ùòàùòªùò¢ùò•ùò™. Freedom. One afternoon the Speaker told me the king would be making a trip to Nahavand, and I should be there to greet him at the airport.  I searched Shahnameh for the perfect quote to welcome him. I chose from one of my favorite stories: the story of Rostam and Esfandiyar. In this story Rostam is a much older man. He‚Äôs served many kings. But the current king has turned oppressive, and Rostam refuses to obey his commands. The king sends his son Esfandiyar to arrest Rostam. Esfandiyar promises Rostam that the king only wishes to set an example. He says: ‚ÄòPlease, just let me bind your hands.‚Äô He promises that he‚Äôll immediately be released. He promises Rostam all the riches of Iran, if only he‚Äôll allow his hands to be bound. Esfandiyar is protected by a divine blessing. He has never been beaten in battle. And Rostam knows that if they fight, he will almost certainly die. But still, he will not allow his hands to be bound.  He‚Äôd never give up his ùò¢ùòªùò¢ùò•ùò™. Here Ferdowsi shows his genius. The dialogue is rich. The men dine together. They share wine. They flatter each other. Each man does everything to persuade the other to change his mind. But their fate was already written. They would battle to the death. Because one could not disobey his king. And the other could not disobey his code.‚Äù",
