        "shortCode": "CxJjE8vLsm_",
        "caption": "(28/54) ‚ÄúThe king loved Iran. And I believed him when he claimed that it was his dream to have a more open society one day. With a truly free press. And truly free elections. But he didn‚Äôt think Iran was ready. It was fear. So many foreign powers were trying to control Iran. The country was full of spies. He‚Äôd already survived two assassination attempts, and he saw enemies everywhere. I never viewed myself as an enemy of the king. There was only one thing I wanted. It was the same thing I‚Äôd wanted since I was a little boy, when I saw him for the first time. When I touched his coat. I wanted him to be a good king. I wanted him to respect the constitution. I wanted him to involve the people, and hear our voice. On the day of his visit I was excited to welcome him to Nahavand. I wanted to show him that we were trusting the people to make their own choices, their own decisions. I arrived early to the airport. The king‚Äôs handlers explained how the welcoming ceremony would proceed. I was to stand on the tarmac about fifty meters from where the king‚Äôs helicopter was supposed to land. He would speak to me first. And then he would go on to speak to a crowd of dignitaries gathered behind me. I walked out to my assigned spot. I was out there all alone, with a crowd of fifty people watching. I had my quote from Shahnameh ready. It‚Äôs from the moment that Rostam welcomes Prince Esfandiyar. He says: ‚Äòùòâùò≠ùò¶ùò¥ùò¥ùò¶ùò• ùò™ùò¥ ùò∫ùò∞ùò∂ùò≥ ùòµùò©ùò≥ùò∞ùòØùò¶. ùòàùòØùò• ùò£ùò≠ùò¶ùò¥ùò¥ùò¶ùò• ùò¢ùò≥ùò¶ ùòµùò©ùò¶ ùò±ùò¶ùò∞ùò±ùò≠ùò¶ ùò∞ùòß ùòêùò≥ùò¢ùòØ, ùòßùò∞ùò≥ ùòµùò©ùò¶ùò∫ ùò¢ùò≥ùò¶ ùòµùò©ùò¶ ùò®ùò∂ùò¢ùò≥ùò•ùò™ùò¢ùòØùò¥ ùò∞ùòß ùò™ùòµùò¥ ùòßùò∂ùòµùò∂ùò≥ùò¶.‚Äô When the helicopter landed, the king stepped out. He gave a quick salute to his military escort. And then he began to walk my way. I had my words ready, but I did not get to speak them. He did not stop. He did not slow down. He didn‚Äôt even look me in the eye.‚Äù",
