        "shortCode": "CxJo0ywNNXS",
        "caption": "(29/54) ‚ÄúThe riots began in Qom. One day Khomeini gave a speech saying that the moment had arrived for a true Islamic revolution. And that it was the duty of all Muslims to oppose the monarchy. The rioters targeted anything they deemed anti-Islamic: cinemas, liquor stores, shops selling Western clothes. When the police tried to crack down, a few of the rioters were killed. Khomeini declared the men to be martyrs, and forty days later a public memorial was held. Huge crowds came out. And the rioting began again. It was as constant as the beat of a drum: riots, deaths, memorial. Riots, deaths, memorial. Every forty days there would be another wave. And with every wave the destruction would grow. Eventually the riots spread to the capital. Many mornings I would walk to parliament because the traffic was so bad. One morning I was forced to take a different route entirely, because rioters were destroying a liquor store. They were breaking hundreds of bottles in the street, and the gutters were filled with liquor. My colleagues in parliament were nervous, but I was optimistic. I thought this might even be an opportunity for us. Our entire careers we‚Äôd been in the opposition. We often spoke against the king‚Äôs policies. Now the people were mobilized. They were in the streets. They were looking for an alternative. Maybe this would be the moment that the king would finally hear the voice of the people. Maybe this would be the moment for us to have a true constitutional monarchy. Khomeini wanted to bring Iran back to the dark ages.  But I knew that Khomeini didn‚Äôt represent the Muslims of Iran. Iran had been Islamic for one thousand years. We were the nation of Rumi. The nation of Hafez. These fanatics did not represent our religion. I even gave a speech from the podium of Parliament where I quoted the Koran. It was the words of Allah: ‚ÄòThose who are furthest from evil, are closest to me.‚Äù",
