        "shortCode": "CxJ0JhLNtoz",
        "caption": "(32/54) ‚ÄúIn the end the king turned against his own friends. One day a colleague approached me in the halls of parliament. She was married to a former minister, and the king had just thrown her husband in jail to appease the mobs. She asked me what I thought was going to happen. I answered with a quote from Shahnameh: ‚ÄòTomorrow I will calm your fear.‚Äô Even then I still had hope. I thought we still had time to save the country. But those were the end days. On the Friday after Ramadan there was a protest in one of Tehran‚Äôs main squares. The army panicked and fired machine guns into the crowd. One hundred people were killed, and that night one hundred fires raged in Tehran.  Strikes began to hit the country. Everything shut down: schools, factories, air travel, even the oil industry. The lifeblood of Iran. The country became like a paralyzed man, gasping for its final breaths. In October the king went on television. It would be his final speech to the Iranian people. By then he was suffering from late-stage cancer. He was a very sick man. He apologized for past mistakes. He said: ‚ÄòI am the guardian of a constitutional monarchy, which is a God-given gift. A gift entrusted to the Shah by the people.‚Äô He said that he had finally heard our voice, but it was too late. The people had stopped listening. The king only had one option left. His generals were still loyal. He still controlled the military, and there were half a million men under arms. He could fight. He could hold onto power, but only if he spilled the blood of Iranians. He had a choice. There‚Äôs always a choice to be made. Three months later I was listening to Mohsen Pezeshkpour give a speech from the podium of parliament; he was the founder of the Pan-Iranist party. In the middle of his speech, a messenger handed a note across the podium. He read the note, then over the microphone we heard him ask loudly: ‚ÄòWhere did he go?‚Äô The crowd let out a gasp. We knew then, the king was gone. The flag had fallen. The day was lost. And there‚Äôd be no more role for us to play. That‚Äôs the problem with absolute power. It‚Äôs like a tent with a single pillar. And when you take out that pillar‚Äîeverything collapses.‚Äù",
