        "shortCode": "CxLbZJALK1T",
        "caption": "(33/54) ‚ÄúOn the day Khomeini‚Äôs plane landed the road from the airport was lined with hundreds of thousands of cheering people. I hadn‚Äôt completely lost hope. The king was gone. But we still had a government, a parliament, a constitution. The only thing new was this man. Maybe he‚Äôd been telling the truth. Maybe he truly did want an open society. Khomeini had surrounded himself with liberal advisors. Maybe he‚Äôd allow them to run the country. Maybe he‚Äôd go to Qom and study his books. The parliament decided to form a small delegation to meet with him; to find out his plans. Since I‚Äôd been such a vocal member of the opposition, it was decided that I should go along. Khomeini had taken up residence in a school building directly behind the parliament. When we arrived we were escorted into an empty classroom. There was no furniture. Pillows and blankets were piled against the wall; it was clear that people had been sleeping there. After five minutes Khomeini entered the room. He was dressed all in black. After he took his seat we explained that we were hoping for a peaceful transition of power. One that kept the constitution intact, and the parliament in place. We presented a list of ministers that we thought he would approve. He listened in silence. At no point did he ask a question. At no point did he give a response. It was clear that he had no need for our participation. Power was in his hands. When we finished making our proposal, he asked us to deliver two messages. One: he wanted us to tell the military that they had his full support. And two: that no one would be harmed, except for the king. When asked later about his promises, he would claim that Islam allows lying in times of war.‚Äù",
