        "shortCode": "CxJDI9kOpmf",
        "caption": "(23/54) ‚ÄúEach night when I came home from parliament I‚Äôd find Mitra ready to go out. And no matter how tired I felt, off we would go. She always looked perfect. She stayed current with all the latest trends. Every few months she‚Äôd have her hair cut in the style of a different American actress. I loved having her by my side in social situations. I was horrible at parties. I could never think of the right thing to say. If I tried to make a joke, people would tickle themselves to laugh. But not Mitra. She was spontaneous, she was funny. Words came from her like light from a lamp. And she could speak to anyone. There were never any formalities. No warm-up. She‚Äôd talk to every person as if she‚Äôd known them her entire life. We‚Äôd go to gatherings with ten or fifteen of our friends; often Dr. Ameli would be there. As soon as Mitra walked in the room the silence would end. At some point in the evening the conversation would always turn to politics. And the moment I began to debate an issue, Mitra would take the other side. She would team up with anyone against me. The person never mattered. The topic never mattered. She never wanted to get me started, so she‚Äôd always shut me down. It‚Äôs how we‚Äôve been our entire lives. I‚Äôve been the gas, she‚Äôs been the brakes. I thought about her every time I wrote a speech. She‚Äôs always been my antithesis. The hardest for me to convince. It could sometimes seem like her main purpose in life was to oppose me. To the outside world our love made no sense. We seemed so far apart. But there are many types of closeness. And some the world will never see. We still read poetry together. Mitra still trusted me to find the melody. There was one poem called ‚ÄòSin,‚Äô by Forough Farrokhzad. It scandalized religious society; everyone was talking about it. But it was one of Mitra‚Äôs favorites, so I‚Äôd memorized the entire thing: ‚Äú‚ÄòI sinned a sin full of pleasure / in an embrace that was warm and eager / I sinned wrapped in arms / hot, hard, and avenging / in that dark and silent seclusion / I knew his secrets / my heart quivered in my breast / in answer to his hungry eyes.‚Äô‚Äù",
