        "shortCode": "CxJQM50OPKo",
        "caption": "(25/54) ‚ÄúThere is a game that Mitra and I would often play. One of us would recite a verse from a poem. Then whatever letter that verse ended with, the other person would think of a verse that began with that letter. We‚Äôd go back and forth until someone got stuck. And Mitra could not be beaten. Her memory was a library of Persian poetry. When our children were older she applied to the literature program at the University of Tehran. It was a very selective program, but she received one of the highest possible scores on the admissions test. Some mornings I‚Äôd drop her off at school on my way to parliament. She‚Äôd have me drop her off down the street, because she didn‚Äôt want to be seen with a parliamentarian. The college campuses in Tehran had become a hotbed of political protest. With his White Revolution the king had provided free education to the children of Iran. Now those children were grown, and they wanted a say in the future of their country. Many wanted more freedom. They wanted truly free elections. They wanted an end to censorship, an end to political persecution, an end to SAVAK. Others thought the king had brought too many freedoms to Iran: the capitalism, the tight clothes, the violent movies. It was too much, too fast. They wanted a return to tradition. And Islam became a rallying point. But this was the Islam of our fathers. An Iranian Islam. The Islam of Rumi. The Islam of Hafez. During our next break from Parliament I visited a bookshop. The owner reached beneath his desk and pulled out a book by Khomeini-- the cleric from Qom who had incited the riots in Tehran. Khomeini had been sent into exile by the king, but he still had a large following in the country. His speeches were smuggled into the country on cassettes and sold in the bazaar. In his book he called for an Islamic dictatorship. He talked about returning to ‚Äòthe source‚Äô of Islam. Sharia Law. It was an Islam from fourteen hundred years ago. An Islam of cutting off hands, oppression of women, and death for non-believers. He said that ‚ÄòIslam provides a law for every aspect of human life.‚Äô But he did not say how the law would be enforced. That he said, would be figured out later.‚Äù",
