        "caption": "(14/54) ‚ÄúWe began in darkness. Three hundred years after the Battle of Nahavand. The invaders had plundered the country. Caravans of riches were leaving day and night. There was a huge push to break our unity, to erase our identity, to make us forget ourselves. And whenever a conqueror tries to destroy a people, they begin with the language. Scholars were murdered. Books were burned. Entire libraries were razed to the ground. Whenever words were found, they were destroyed. A knight gathered all the texts that remained. And Ferdowsi stepped forward to weave them into a poem. In the prologue of Shahnameh he writes: ‚ÄòI am building a castle of words. That no wind or rain will destroy!‚Äô Ferdowsi attempted to use only the purest form of Persian. He wanted to preserve the entirety of our language. All of our words. But it wasn‚Äôt just our language that he was trying to save, it was our story. Our wisdom. Our soul. Who we were. Ferdowsi drew from many different sources when writing Shahnameh. But one of the most important was The Avesta. The holiest book in ancient Iran. It included many of our oldest stories, from before the written word. In the heart of the book, away from the edges, safe from the sands of time, were the oldest words of Iran: the seventeen hymns of Zoroaster. They were three thousand years old.  And they‚Äôre in the form of a poem. They tell the story of a battle between two great spirits: Ahura Mazda and Ahriman. Good and Evil. Light and Dark. Since the beginning of time these two spirits have been locked in a battle for the soul of the world. And every person must participate. There can be no spectators. There is always a choice to be made. Light or Dark. Good or Evil. ùòïùò¶ùò¶ùò¨ùò™ or ùòâùò¢ùò•ùò™. It‚Äôs a simple choice. But in that choice is an escape from destiny. A promise that the book is not yet written. There is still a role for us to play.‚Äù",
