        "shortCode": "CxHAypgLpQy",
        "caption": "(17/54) ‚ÄúWe still took long walks together. Mitra hated walking through deep forests, they were too dark. She‚Äôd imagine that predators were hiding behind every tree. By that time I‚Äôd begun to organize the workers at my factory. I‚Äôd hold weekly meetings and speak to them about their rights, but Mitra wanted me to stop. She thought it was too dangerous to speak out in a closed society. The Shah had brought many freedoms to Iran, but there‚Äôs one place he stopped short: political freedom. No dissent was allowed. No criticism appeared in the media. And his secret police SAVAK had a reputation for violence. Many of his political opponents shared brutal stories of their treatment in prison. After our Niroo meetings Parvaneh became extremely anti-Shah. She was the basketball player; the one with the strongest voice. She married a fellow activist named Dariush Forouhar, and she joined the party he had formed. They wanted nothing less than full political freedom. And both of them went to jail several times for their views. Dr. Ameli tried to work within the system. He‚Äôd become a member of parliament, but when he spoke out against the king the Pan-Iranist Party was banned. The king saw himself as a king of old. He wanted to rule Iran with a single voice. One year I decided to write about the history of our factory. I saw it as a great example of the Iranian people coming together for a common cause. Forty thousand people were involved: materials had been contributed from local mines, a dam was constructed, an entire city was built for the workers. It had truly been a national project. I spent an entire year on the book. But before it could be published, it had to be reviewed by the secret police. They told me it could not be published unless it was dedicated to the leadership of the Shah. It was abhorrent to me. The Shah played a role, but the factory had been built by the people. By giving all the credit to one man‚Äîit takes away their authorship. I told them: ‚ÄòWrite whatever you want. But take my name off it.‚Äô‚Äù",
