        "shortCode": "CxHGFsItwia",
        "caption": "(18/54) ‚ÄúThe king threw a celebration on the 2500th anniversary of the Persian Monarchy. It was the largest gathering of world leaders in history. He constructed a city of tents around the ruins of Persepolis, where Cyrus‚Äôs grandson Xerxes ruled the ancient world. 1500 cypress trees were planted in the middle of the desert. There were vast carpets of petunias and marigolds. The king opened the ceremony with a speech at the tomb of Cyrus The Great. As he spoke, his voice shook with emotion. He said: ‚ÄòRest in peace, for we are awake. In a troubled world, Iran still bears the message of freedom and humanity. Even in the darkest times, the torch thou lit has never died.‚Äô The king was at the height of his power. Oil prices were at record highs. With each passing year Iran grew wealthier and wealthier, and the king gathered more power into his hands. Every New Year I would gather the children together and read from Shahnameh about the story of Jamshid‚Äîthe fourth king of Iran. Jamshid was the greatest king. The wisest king. The Iranian people gathered around him in adoration, and built him a throne of sapphires, emeralds, and rubies. He taught men to build buildings. He taught men to heal the sick. He unlocked all the secrets of the world. And his throne began to float into the air. With each new gift to the people, it rose higher. And higher. And higher. Until one day it rose too high. Jamshid lost touch with the people. He could no longer hear their voice. He no longer wanted their participation. He gathered his advisors around him, and announced: ‚ÄòAll good things come from me. I am the maker of the world.‚Äô As soon as he spoke these words, his throne began to fall. With tears of blood he begged for pardon, but none was given. And the dread of coming darkness was his lot.‚Äù",
