        "caption": "(10/54) ‚ÄúMitra loved anything beautiful. She kept countless notebooks. And on every page she‚Äôd paste something beautiful: a flower, a feather, a line from a poem. One time we went to a large antique shop, and the owner challenged us to choose the most expensive items in the shop. Mitra looked around the store and chose two that nobody else had noticed. The owner was shocked. He announced that those were the only two that were not for sale. She had a genius for beauty. It was one of her greatest gifts. But her greatest gift by far, was her memory. Mitra could memorize an entire poem after hearing it a single time. Her favorite was Hafez: The Prince of Romance. She‚Äôd memorized two hundred of his ghazals. And whenever she found a verse that she loved, she‚Äôd bring it to me to read. We‚Äôd heard our voices many times before in arguments. But it was different when we read poetry. There was a softness, a delicacy. When you‚Äôre reading a poem, you must find the melody. ùòàùò©ùò¢ùòØùò®. The instrument is your throat. And the words are the notes. Some you strike suddenly‚Äîwith a bang. Others you unroll gently, like a bow being slowly pulled across the string of a violin. Every word has life. Every word has its own soul. The word roar has a soul. ùòíùò©ùò∞ùò≥ùò∞ùò∞ùò¥ùò©! And so does the word kiss. ùòâùò∞ùò∞ùò¥ùò¶ùò©. We were married in the traditional way. It was a small ceremony at the home of Mitra‚Äôs father. On the morning of our wedding Mitra and I visited a famous photographer in Tehran. We took a series of photographs standing side-by-side. She was so conscious of her crippled hand, she found a way to hide it in every photo. But she‚Äôd never looked so beautiful. When the session was finished, I suggested one final photograph. I could tell the photographer was annoyed, but he agreed. And it‚Äôs the photograph that still hangs in our house today. Mitra is sitting on a chair. And I‚Äôm down on one knee, looking up at her, holding her hand.‚Äù",
