        "caption": "(20/54) ‚ÄúDr. Ameli helped me open a party office. He was an established man by then. But he took the time to come to Nahavand, and I‚Äôll never forget the speech that he gave. He said: ‚ÄòNow it is winter, the rivers are frozen, the trees are all dead. But soon green sprouts will burst from the soil. The air will fill with the songs of nightingales. And together we will say: 'Spring has arrived.'‚Äù There were over one hundred villages in Nahavand, and I made the decision to visit every single one. My father loaned me his jeep, and I would spend all day on the road. Most villages had a central square, and that is where I would speak. I was a practicing Muslim; I knew the Koran front-to-back. But I never spoke about religion. I spoke about what needed to be done: better roads, better schools, fresh water. I spoke about justice. Daad. About an Iran where every person got their fair share. And I spoke about freedom. Azadi. I told them: ‚ÄòThe king should not choose your candidates. All of Iran should be your candidates.‚Äô In the first few villages only a handful of people came to my speeches. It was not customary for candidates to speak directly to the voters. My two opponents stayed in their homes and held fancy parties with their friends. But as I continued to speak, word began to spread. More people came, and then those people would go tell others. I‚Äôd always give my speeches around 6 pm. Some of the stores began to close early, so that the shopkeepers could attend. At first it was just a few. But by the end of my campaign, every single shop would close. The moment my jeep pulled into town, it would be met by cheering crowds. Hundreds of people would gather around to hear me. People as far as the eye could see. On the day of the vote I took the jeep for one final trip around Nahavand. I remember seeing young women, with babies on their breast, going to cast their vote. Later that night the results were announced on television. Early in the day people began to gather around my father‚Äôs house. When the vote was announced, the crowd erupted into cheers. Each of my opponents had gotten two thousand votes. I received over twenty thousand.‚Äù",
