        "caption": "(21/54) ‚ÄúAfter the election I took one more visit to Ferdowsi‚Äôs tomb. This time I brought my own children with me. It hadn‚Äôt changed much in thirty years, but I had changed. I had a better understanding of the sacrifice he‚Äôd made for his ideals. Ferdowsi worked for thirty-three years. Seven verses a day. ùòà ùò§ùò¢ùò¥ùòµùò≠ùò¶ ùò∞ùòß ùò∏ùò∞ùò≥ùò•ùò¥, ùòµùò©ùò¢ùòµ ùòØùò∞ ùò∏ùò™ùòØùò• ùò∞ùò≥ ùò≥ùò¢ùò™ùòØ ùò∏ùò™ùò≠ùò≠ ùò•ùò¶ùò¥ùòµùò≥ùò∞ùò∫. While my children played in the gardens I stood quietly at the foot of his tomb. I ran my fingers across the stones. ‚ÄòIn The Name of The God of Soul and Wisdom.‚Äô ùòëùò¢ùò¢ùòØ and ùòíùò©ùò¶ùò≥ùò¢ùò•. The two things all humans have. The wisdom to choose. And the soul to create. When I received the development budget for Nahavand, I called a meeting in the town‚Äôs biggest auditorium. Each village sent a representative. I told them: ‚ÄòGod created the earth, the trees, and the waters‚Äîbut after that he did not make a single chair. He has left the rest to us.‚Äô I told them: ‚ÄòOrganize a council, assess your own needs, make specific proposals.‚Äô I‚Äôd only pay for things that could be seen, because I wanted no corruption in Nahavand. And priority was given to projects where labor was provided by the villagers themselves. I wanted them to get involved, participate. I wanted them to feel a sense of ownership. I wanted an Iran where everyone felt like the king or queen of their own country. Back then it was common for villagers to kiss the hands of government officials. I would not allow it. I told them: ‚ÄòWe don‚Äôt need to do this anymore.‚Äô If I was unable to stop them in time, I‚Äôd kiss their hand right back. There was one woman in Nahavand who lived in a tent. I promised her that I would not own a home before she did. I tended Nahavand like I tended my garden. I picked every weed the moment it appeared.  I followed up on every call, every letter. My phone was never unplugged. My plan was to serve two or three terms, so that I could gain some experience and build my name. Then I‚Äôd bring my ideas directly to the people. What I could do for my garden, I could do for Nahavand. And what I could do for Nahavand, I could do for all of Iran.‚Äù",
