        "caption": "(11/54) Before our wedding Mitra‚Äôs father gave her one final piece of advice: ‚ÄòNever let a man enforce his opinions on you.‚Äô And she took it to heart. She was my opposite. My antithesis. The hardest for me to convince. She would tell me I was too optimistic. She‚Äôd say that I only saw the best in things, whether that be people, Iran, or Shahnameh. After our marriage I finally convinced her to read it with me. We‚Äôd just moved to Germany so that I could attend university. Each night when I came home from class, she‚Äôd lay her head in my lap and I‚Äôd read her a chapter. It was my second time reading the book all the way through. My first time as an adult. As a boy I‚Äôd always been drawn to Rostam‚Äôs feats of strength: his taming of Rakhsh, his defeat of the demon king, his slaying of the dragon.  But now I noticed something else. Rostam lived by a code. He would not serve an evil king. He would only serve his ideals. ùòãùò¢ùò¢ùò•. Justice. ùòôùò¢ùò¥ùòµùò™. Truth. And most of all, ùòàùòªùò¢ùò•ùò™. Freedom. Rostam would never sacrifice his freedom. The great champions of Shahnameh were more than warriors, they were vessels for our ideals. Even in the darkest times, even in the times of greatest danger, they lived by their code. I did my best to interest Mitra in certain parts. When I came to the story of the female knight Gordafarid, I quickened my pace. I filled my words with excitement: ‚ÄòThe battle was nearly lost. Gordafarid‚Äôs commander had been captured on the battlefield. Her castle was completely surrounded by the enemy. Gordafarid tried to rally the men to fight, but none would join her. They wanted to stay behind the castle walls. They wanted to surrender. Gordafarid‚Äôs cheeks turned black with rage. She grabbed her bow and arrow, tied her hair beneath her helmet, and rode out to face the enemy alone. She stopped just short of the enemy lines, and like a lion she roared: 'ùòûùò©ùò¶ùò≥ùò¶ ùò¢ùò≥ùò¶ ùò∫ùò∞ùò∂ùò≥ ùò§ùò©ùò¢ùòÆùò±ùò™ùò∞ùòØùò¥?‚Äô In the heat of the story, I peeked down at Mitra to see if she was scared. But she‚Äôd fallen asleep.‚Äù",
