        "caption": "(16/54) ‚ÄúWhen the children were old enough I started reading them Shahnameh before they went to sleep. The stories of Rostam were too violent. They‚Äôd cry and cry. So I started with the stories of Iran‚Äôs mythic kings. These were the first kings of Iran. They discovered fire, language, and law. Some of them spoke to animals. Others lived for hundreds of years and sat on floating thrones made entirely of precious stones. It‚Äôs not known if Ferdowsi intended to name his book Shahnameh. The Book of Kings. But the title fits. For as long as there has been an Iran, there has been a king. In 1967 Mohammed Reza held a coronation ceremony. By that time he‚Äôd already been king for twenty years. But he‚Äôd wanted his coronation to wait, until Iran was prosperous. And now it was. The Shah had come a long way since that day I‚Äôd first seen him in the shrine. He‚Äôd tightened his grip on power, and his popularity was at an all-time high. The White Revolution had been a massive success. Iran was rapidly industrializing. Millions of Iranians were lifted out of poverty. Hundreds of new schools and universities were built. And it was a time of great freedom. Iranian women had more rights than anywhere else in the Muslim world. They could vote, obtain a divorce, own property, and run for office. In the words of Saadi: ‚ÄòThe homeland is where no one disturbs the other.‚Äô In Tehran you could see women in mini-skirts standing next to women who were fully-veiled. On the day of his coronation The Shah rode to the palace in a golden carriage pulled by eight Hungarian stallions. As he passed the streets were filled with shouts of ‚ÄòLong Live The King!‚Äô Trumpets blared. Guns fired. The Air Force dropped 17,532 roses from the sky. One for every day of his life. At the coronation a crown of diamonds was placed upon his head, and he took his seat on the famous Naderi throne. It was decorated with carvings of lions and dragons. And it was covered with 25,000 precious stones.‚Äù",
