        "shortCode": "CxGUDW_LF8f",
        "caption": "(12/54) ‚ÄúShe was brave in many ways. But there were three things that Mitra feared most: darkness, silence, and being alone. In Germany we‚Äôd take long walks through the countryside. Mitra couldn‚Äôt stand the quiet. She‚Äôd recite entire poems back-to-back-to-back. At the time she‚Äôd gotten into modern poetry. Her favorite poet was a young woman named Forough Farrokhzad. Farrokhzad was a modern poet. She wrote in free verse. She wrote from a feminine perspective. Religious society called her a ‚Äòwhore‚Äô and a ‚Äòslut.‚Äô Because she wrote about everything. Including sex. By the time we finished Shahnameh I think I‚Äôd destroyed Mitra‚Äôs interest in the book. The book‚Äôs longest section is the historical section. Here the heroic nature of the prose fades. There are no more dragons. No more Rostam and Gordafarid. Here Ferdowsi writes about real people. He must stick to what is known. You can‚Äôt turn a real person into a mythic hero. That summer I took a road trip home to Iran. The Shah had just announced his White Revolution. It was a sweeping campaign of reform. Women were given the right to vote. Factory workers gained a share in profits. Agricultural estates were seized and redistributed to the sharecroppers who worked the fields. With one referendum the Shah gave more freedom to millions of Iranians. But not everyone supported it. When I arrived in Tehran the city was in chaos. Several buildings on my street were in flames. A cleric named Khomeini had come out against The White Revolution, and he‚Äôd ordered his followers to riot. Khomeini practiced a different kind of Islam. This was not the Islam of our fathers. This was not the Islam of the Persian Mystics. This was an Islam of cutting off hands, death for nonbelievers, and oppression of women. We thought these things were demons from our history. Monsters buried far in our past. But there‚Äôs a parable in ùòîùò¢ùò¥ùòØùò¢ùò∑ùò™, where Rumi writes about a dragon frozen in a block of ice. The dragon seems to be dead. So the people place him on a cart and wheel him into the center of the city. They‚Äôll soon discover that he‚Äôs still alive. He was only sleeping, waiting for things to heat up.‚Äù",
