        "shortCode": "CxDz8HuL454",
        "caption": "(4/54) ‚ÄúMy father named me Parviz‚Äîafter one of Iran‚Äôs ancient kings. His story comes at the end of Shahnameh, in the historical section. Parviz was a good king. Not a great king, but a good king. His reign was a golden age of music. But he made many mistakes. His grandson Yazdegerd would be the last king of the Persian Empire. Every day on the way home from school I‚Äôd pass by the ruins of an ancient castle, where he made his final stand against the armies of Islam in 642 AD. The Battle of Nahavand was the bloodiest defeat in the history of our country. Most days when I got home I‚Äôd go straight to my room and read Shahnameh. The book opens in myth: our oldest stories, from before the written word. But the poets say our myths are even truer than our history. They emerge from the collective psyche. They hold our dreams. They hold our ideals. When Ferdowsi writes about our mythic heroes, he writes about all of us. And in Shahnameh there is no greater hero than Rostam. The Heart of Iran. A knight with the height of a cypress. And a voice to make, the hardened hearts of warriors quake. At one point in Shahnameh Iran is on the brink of defeat. Three enemy kings have joined their forces. Our armies are almost beaten. Rostam arrives at the battlefield on foot: no horse, no armor, carrying nothing but a bow and arrow. And with a single shot he slays the greatest champion of the other side. I wanted to be Rostam. My brother and I built a gym behind our garden. We took the heads off of shovels and made parallel bars. We made barbells out of clumps of dirt. We‚Äôd wrestle sixty times a day. And while we wrestled my brother‚Äôs friend would beat a drum and chant our favorite verses about Rostam: his defeat of the demon king, his battle with the dragon. There were no dragons in Nahavand, but there were ibex. They only lived at the highest elevations. And they were beautiful with their horns. I‚Äôd climb all night. I‚Äôd make my way by moonlight. The cliffs were covered in ice, a single slip could mean death. But I‚Äôd reach the summit by dawn, and watch the sun come up on herds of ibex grazing on the peaks.‚Äù",
