        "shortCode": "CxEC8UBOYYu",
        "caption": "(6/54) ‚ÄúOne New Year our whole family took a bus to Qom‚Äî one of the holiest cities in Iran. When we arrived in the city it was like stepping back in time. This was a different kind of Islam. It wasn‚Äôt my father‚Äôs. It wasn‚Äôt even my mother‚Äôs. It was an Islam from fourteen hundred years ago. The bookstores only stocked religious books. There were no radios, no music. My nine-year-old sister tried to buy some glass bracelets at the bazaar, but the shopkeeper wouldn‚Äôt serve her. Because she wasn‚Äôt wearing a hijab. When he turned his back I broke the bracelets against the table. In the afternoon I was given time to explore on my own. I remember I was wearing long pants. I‚Äôd never worn long pants before, so I felt like a man. I made my way to the biggest shrine in the city. There was a huge crowd for the holiday. As I pushed my way through, the crowd began to sway and move. People began to shout all around me. Hats were thrown in the air. I couldn‚Äôt see what was happening, even when I stood on the tips of my toes. But suddenly the crowd began to part. If I‚Äôd been one step further back, it would never have happened. But a path opened up in front of me. And there he was. I‚Äôd seen his portrait every day of my life on the inside cover of my Shahnameh: Mohammed Reza Shah. The king of Iran. He was not yet the famous Shah that he‚Äôd one day become. At the time he was still a young man. But on that day he seemed to me like one of the great kings of Shahnameh. I was a shy child, but something came over me. I broke free from the crowd and began to follow him. He took off his shoes, I took off my shoes. He entered the shrine, I entered the shrine. This was my chance. I‚Äôd never been so close to a king. I knew I had to do something, so I reached out. And I touched his coat. I touched the coat of a king. That night when I came home I looked at myself in the mirror. Ferdowsi describes Rostam as having the height of a cypress. And arms that could rip rocks from the side of a cliff. I took one look at my scraggly body, and decided I was much too skinny to be a knight. But my garden was the best, it was plain for all to see. So I decided I would become the shah of Iran.‚Äù",
