        "caption": "(9/54) ‚ÄúThe club was called ùòïùò™ùò≥ùò∞ùò∞. The Force. There were ten of us. We were all so different. But we were like charms on a bracelet‚Äîunited by our love for Iran. It was nothing important: we‚Äôd graffiti our slogans onto walls. We‚Äôd stand on busy street corners and try to convert people to our cause. But it felt so important. We felt like we were building a new Iran around us. We held our meetings in an attic. We‚Äôd check the street for spies before we went inside. I had one of the strongest voices in the group, so I‚Äôd open each meeting by reciting a hymn about loving Iran. We‚Äôd review our activities from the previous week. Then Dr. Ameli would lead us in long discussions about the meaning of Iran. Dr. Ameli was a nationalist. But it wasn‚Äôt a nationalism of expansion. It was a nationalism of preservation. A nationalism based on history and culture, with respect for all people. That‚Äôs one of the very first things he taught us: ‚ÄòWhat is true, must be true for everyone.‚Äô We learned that the Persian Empire began when Cyrus The Great united a group of nomadic tribes in 550 BC. Many consider Cyrus to be the founder of human rights. Whenever he conquered a new territory, he outlawed slavery. He allowed everyone to live with their own language and religion. In the ancient world Iranians were known as ùòàùòªùò¢ùò•ùò¶ùò©. Free people. It‚Äôs even in the Shahnameh. When one of our champions is mistaken for an angel, he says: ‚ÄòI come from Iran. The land of the free.‚Äô Listening to Dr. Ameli speak about the foundations of Iran, we felt like we‚Äôd discovered something hidden. An Iran built on ideals. ùòôùò¢ùò¥ùòµùò™. ùòïùò¶ùò¶ùò¨ùò™. ùòãùò¢ùò¢ùò•. An Iran built on freedom. ùòàùòªùò¢ùò•ùò™. During the final meetings of ùòïùò™ùò≥ùò∞ùò∞ that I ever attended, we were joined by a girl named Parvaneh. She was a basketball player; and her voice was just as strong as mine. At the close of each meeting, we‚Äôd lead the group in the swearing of seven oaths. I don‚Äôt remember all seven, but I remember the final. To give our lives for Iran.‚Äù",
