        "shortCode": "CxDlLBIONSy",
        "caption": "(2/54) ‚ÄúI couldn‚Äôt find it anywhere. Even on the streets of Tehran‚Äîit was nowhere to be seen. The Iran I knew was gone. Everywhere I turned it was nothing but black: black cloaks, black shrouds. The universities were closed, the libraries were closed. Our poets, our singers, our authors, our teachers: one-by-one they were silenced. Until Iran only survived inside our homes. I never planned to leave. I didn‚Äôt even have a passport. Twenty years earlier I‚Äôd sworn an oath to The Siren: every choice I made, I‚Äôd make for Iran. But The Siren was dead. They shredded his heart with bullets. And there was only one choice left: leave and live, or stay and die. It was an eight-hour drive to the Turkish border. Mitra came with me. We rode in silence the entire way. I‚Äôve always wondered how things would have turned out differently if we‚Äôd been more aligned. She wanted our lives to be a love story. A surreal romantic journey. She wanted a life of togetherness, surrounded by beauty. For me life was meant to be lived in the pursuit of ideals: truth, justice, freedom. Even if that meant the ultimate sacrifice. We kissed goodbye in the border town of Salmas. In the main square stood a statue of Iran‚Äôs greatest poet: Abolqasem Ferdowsi. On that day it was still standing. Soon the regime would tear it down. I spent the night in the house of a powerful family who was known to oppose the regime. Their servants stood around the house with machine guns on their shoulders. Six months later they‚Äôd all be dead. On my final morning in Iran I woke with the sun. I knelt on the floor and prayed. The final journey was made on foot. It was six miles to the border, the road climbed through the mountains. It was a closed border; so the road was empty. Every step felt like death. I‚Äôve never cried so many tears. Ferdowsi once wrote: ‚ÄòA man cannot escape what is written.‚Äô I‚Äôve always hated that quote. I hate the idea of destiny. There is always a role for us to play. There is always a choice to be made. But on that day it felt like destiny, a river flowing in one direction. And I was a leaf, floating on top. Away from where I wanted to go.‚Äù",
