        "caption": "(5/54) ‚ÄúThe meaning of our most important words I learned from my mother. ùòôùò¢ùò¥ùòµùò™: Truth. I never heard her tell a lie. ùòïùò¶ùò¶ùò¨ùò™: Goodness. I never heard her gossip. And ùòîùò¶ùò©ùò≥: Love. We were three brothers and five sisters, but she loved us all equally. There were no assigned places at our dinner table. Everyone got their desired portion. While we ate our father would encourage us to debate the events of the day. No topic was off limits: history, politics, even the existence of God. And everyone was encouraged to use their voice. One weekend my father drove us all to visit Ferdowsi‚Äôs tomb in the city of Tus. It‚Äôs a large tomb. It‚Äôs modeled after the tomb of Cyrus The Great. On its face is etched the first line of Shahnameh. The master verse. The cornerstone: ‚ÄòIn the Name of the God of Soul and Wisdom.‚Äô ùòëùò¢ùò¢ùòØ and ùòíùò©ùò¶ùò≥ùò¢ùò•. Soul and Wisdom. The two things that all humans have. With the opening line Ferdowsi does away with all castes and classes. He does away with all religion. He gives everyone a direct connection to the creator. As a young boy I‚Äôd memorized hundreds of verses. One of my favorite stories in Shahnameh is when Rostam selects his horse. Rakhsh is the only horse in Iran that can carry Rostam‚Äôs weight. Rakhsh has the body of a mammoth. But he's wild, he foams at the mouth. Rostam has to fight to tame him. I was a shy child. But something happens when I read Shahnameh. There‚Äôs an epic cadence. The words demand to be spoken.  It‚Äôs like touching a hot stove. I feel the heat, I feel the pressure. It‚Äôs like a sword pierces my body and I have to let it out: ‚Äòùòôùò¢ùò¨ùò©ùò¥ùò© ùò≥ùò∞ùò¢ùò≥ùò¶ùò• ùò£ùò¶ùòØùò¶ùò¢ùòµùò© ùòôùò∞ùò¥ùòµùò¢ùòÆ!‚Äô The neighbors would come running to their balconies to watch. Every region in Iran has its own dialect, and I could switch between them. The language is ancient, so I didn‚Äôt know the meaning of every word. But I could feel the music. When I mispronounced a word, I knew. As if I‚Äôd played a wrong chord. I could almost tell what he wanted. I could almost hear the voice of Ferdowsi himself.‚Äù",
