        "shortCode": "CxEKLXpOTDK",
        "caption": "(7/54) ‚ÄùIn Shahnameh there‚Äôs one word that Rostam uses more than any other: ùòãùò¢ùò¢ùò•. Justice. ùòãùò¢ùò¢ùò• is a simple concept. It means that everyone gets what they deserve: both good and bad. Everyone gets a fair share. The Nahavand of my childhood was very poor. People would come to our door each day asking for a single piece of bread. It seemed unjust to me. So I decided I would not eat more than that. My mother begged and begged, but I would not do it. I decided that if I became king, every child in Iran would be given their fair share. But until then I should participate in their suffering. I had no idea how I would become king. In Shahnameh it seemed so simple. Good kings glowed with light. Their wisdom was plain for all to see. I was an optimistic child. I felt that if I could use my voice, and speak about ùò•ùò¢ùò¢ùò•‚Äîthen a path would open up before me.  When I turned fifteen I went to boarding school in Tehran. It was nothing like Shahnameh. Half a million people lived there, and it was a time of great upheaval. A huge debate was being held over the nationalization of oil. The streets were filled with voices of every kind, and nobody could agree on the future of Iran. I realized that many people didn‚Äôt want the same things that I wanted, and for complicated reasons. At the end of each week I‚Äôd go to the house of a relative to pick up my allowance. His wife was the first person in Iran to have a cooking show on the radio, so sometimes I‚Äôd stay for dinner. They had a young daughter named Mitra. Her hair was cut short in the style of a famous American actor. One of her hands was crippled by polio. She was very shy about it, but it was never something I noticed. Back then most Iranian girls were modest and deferential, but not Mitra. And she argued with everyone: her friends, the help, her family, and me. One night over dinner I started speaking about the past greatness of Iran: who we were. Back in the days of Shahnameh. When I finished talking, Mitra was the first to speak. She said: ‚ÄòYou talk about Iran like it‚Äôs a lion. But it‚Äôs a cat.‚Äù That was the year I discovered something new. There are love stories in Shahnameh too.‚Äù",
