        "caption": "(3/54) ‚ÄúIt‚Äôs been forty-three years since I‚Äôve seen my home. All I have left is a jar of soil. It‚Äôs good soil. Nahavand is a city of gardens. A guidebook once called it ‚Äòa piece of heaven, fallen to earth.‚Äô The peaks are so high that they‚Äôre capped with snow. A spring gushes from the mountain, and flows into a river. It spreads through the valley like veins. We lived in the deepest part of the valley, the most fertile part. Our father owned thousands of acres of farmland. When we were children he gave us each a small plot of land to plant a garden. None of the other children had the discipline. They‚Äôd rather play games. But I planted my seeds in careful rows. I hauled water from a nearby well. I pulled every weed the moment it appeared. As the poets say: ‚ÄòIf you cannot tend a garden, you cannot tend a country.‚Äô My garden was the best; it was plain for all to see. The discipline came from my mother. She was very devout. She prayed five times a day. Never spoke a bad word, never told a lie. My father was a Muslim too, but he drank liquor and played cards. He‚Äôd wash his mouth with water before he prayed. The Koran was in his library. But so were the books of The Persian Mystics: the poets who spent one thousand years softening Islam, painting it with colors, making it Iranian. Back then it was a big deal to own even a single book, but my father had a deal with a local bookseller. Whenever a new book arrived in our province, it came straight to our house. I‚Äôll never forget the morning I heard the knock on the door. It was the bookseller, and in his hands was a brand-new copy of Shahnameh. The Book of Kings. It‚Äôs one of the longest poems ever written: 50,000 verses. The entire story of our people. And it‚Äôs all the work of a single man: Abolqasem Ferdowsi. Shahnameh is a book of battles. It‚Äôs a book of kings and queens and dragons and demons. It‚Äôs a book of champions called to save Iran from the armies of darkness. Many of the stories I knew by heart. Everyone in Iran knew a few. But I‚Äôd never seen them all in one place before, and in a beautiful, leather-bound edition. The book never made it to my father‚Äôs library. I brought it straight to my room.‚Äù",
