                "id": "18237654916229820",
                "text": "As the daughter of an immigrant (who came for other reasons and from a different country), I feel in my spirit a yearning for my heritage for the lands where generations of my ancestors lived and died. I feel an interruption of something that was but no longer is. My roots are newly planted and will not intertwine with the roots of my ancestors. I will not fully know their growth and progress much as I'd like to. My transplanted heart feels for this man and his yearning for home.",
