        "shortCode": "CxESE0TL6m0",
        "caption": "(8/54) ‚ÄúThere‚Äôs only one way for love to begin in a traditional society. With the eyes. At the dinner table Mitra disagreed with everything I said. If I said ‚Äòred,‚Äô she said ‚Äògreen.‚Äô If I said ‚Äòspice,‚Äô she said ‚Äòsweet.‚Äô But there was something between us. I could see it in the eyes. It was like glancing at a beautiful mountain from afar. The mountain hasn‚Äôt been experienced yet. Its cliffs have not been climbed. Its flowers have not been picked. But you are drawn to its beauty, even at a distance. On her fifteenth birthday I got her flowers. It was winter. There weren‚Äôt many flowers during winter. So I went to an Armenian flower shop and got fifteen white carnations, with one red in the center. I was shy with my words, so I wrote her a long letter. I told her the story of the female knight Gordafarid, one of the bravest champions in all of Shahnameh. Gordafarid was a master of archery. No bird could escape her arrows. And she was beautiful: her face glowed like the moon. Her waist was cypress-shaped. Her hair was worthy of a crown. I told Mitra: ‚ÄòShe‚Äôs just like you. Together we can do great things for Iran!‚Äô Mitra hid the letter from her father. One night over dinner I told him about my plans to become king. I told him that I would use my voice, and speak about ùòãùò¢ùò¢ùò•. Justice. He said: ‚ÄòThis boy is delusional! He‚Äôs living in a thousand-year-old book!‚Äô He told me that Iran was a constitutional monarchy. And unless I planned to lead a coup, the highest I could rise was Prime Minister. He said that Iranians were too worried about survival to care about ideals. So if I wanted to be Prime Minister, I‚Äôd need to put away childish ideas and learn about the real world. A few weeks later I joined a club of students at my school who met each week to discuss politics. It was the youth chapter of a new party called the Pan-Iranist Party. The leader of the club was a medical student from the University of Tehran. His name was Dr. Mohammadreza Ameli Tehrani. But everyone called him by his nickname: The Siren.‚Äù",
