        "shortCode": "CxB3bhbrzbV",
        "caption": "(1/54) ‚ÄúWe begin in darkness. A siren screams. The invaders come from the desert in a cloud of dust. The king gathers his army at a mountain castle. A single battle decides our fate. The battle burns, the din of drums, the clash of axes, the spark of swords. The dirt turns clay with blood. The sun goes down on a fallen flag. The day is lost. The king is gone. Our people are left defenseless. The only weapon we have left is our voice. So they come for our words. Scholars are murdered, books are burned, entire libraries are turned to dust. Until nothing remains. Not even memories of who we were. Silence. The sun comes up on a knight galloping across the land. He summons the teachers, the scholars, the authors, the thinkers. He tells them to gather the words that remain: the books, the scrolls, the letters, the verses. Everything that escaped the burning pits. Then he summons the sages. The keepers of our oldest myths, from before the written word. He copies their stories onto the page. Then when all has been gathered, all of the words, only then does he summon a poet. It had to be a poet. Because poetry is music. It sinks into the memory. And in this land of endless war, the only safe library is the memory of the people. It is said that at any given time there are one hundred thousand poets in Iran, but only one is chosen. A single poet, for a sacred mission. Put it all in a poem. Everything they‚Äôre trying to destroy. The entire story of our people. Our kings. Our queens. Our castles. Our banquets. Our songs and celebrations. Our goblets filled with wine. Our roasted kebabs. Our moonlit gardens. Our caravans of riches: silken carpets, amber, musk, goblets filled with diamonds, goblets filled with rubies, goblets filled with pearls. Our mountains. Our rivers. Our soil. Our borders. Our battles. Our crumbled castles. Our fallen flags. Our blood. Who we were. Who we were! Our culture. Our wisdom. Our choices. And our words. All of our words. Three thousand years of words, a castle of words! That no wind or rain will destroy! However long it takes, put it all in a poem. All of Iran, in a single poem. A torch to hold against the night! A voice to echo in the dark.‚Äù",
