        "shortCode": "CtUE3TGLtuf",
        "caption": "‚ÄúI was walking down Broadway with my friend from China. Everyone kept waving at me, and saying: ‚ÄòHi John, Hi John.‚Äô And my friend said: ‚ÄòWow. Everyone knows you!‚Äô I said: ‚ÄòC‚Äômon. That‚Äôs an exaggeration.‚Äô Right then the door to the Imperial Theatre opened up, and it was an actor friend. He gave me the biggest hug. I said: ‚ÄòOK, maybe it‚Äôs not an exaggeration.‚Äô Everyone does know me. I‚Äôve been dancing for almost seventy years. It didn‚Äôt run in my family. My father was a subway motorman. But when I was sixteen I signed up for lessons with a famous Russian ballet dancer. She was a little lady; told me that I danced like a lobster. Not exactly encouraging, but when I came down the stairs after my first lesson, Eartha Kitt was waiting in the lobby. Not that she was waiting for me; it was for someone else. But I saw it as a sign. I thought: ‚ÄòI‚Äôm on my way.‚Äô A few months later I made my debut dancing to bagpipes at the Scottish Highland Festival. Then after that I got a gig at the Wine and Cheese Festival. And I never stopped. I wasn‚Äôt good enough to do it full time. I had to work as a Spanish teacher for thirty-three years. I was competent; my kids did well on the tests. But I wouldn‚Äôt say I was beloved. And when your name is Mr. Bate, the kids are going to call you Masturbate. It‚Äôs unavoidable. But each day when that 2:42 bell rang after eighth period; I got on a train and headed to my second life. I‚Äôve danced it all. I was a flamenco dancer. I learned Afro-Haitian, Afro-Cuban, Afro-Brazilian. I danced in the Sambadrome during Carnival. I danced with an Appalachian clogging company. I‚Äôve danced in every major theater on Broadway. My specialty was screwing up the choreography. I‚Äôve actually heard audience members say: ‚ÄòOh no, not him again.‚Äô But I always figured out a way to work. I‚Äôve played every kind of character role. I‚Äôve played Von Rothbart, the evil Magician. I‚Äôve played Nutcracker. But the role I loved best was Handsome Haldor. He was a total flop. But in his mind-- he was the most magnificent man in the entire kingdom.‚Äù",
