        "shortCode": "CtZi6UkrOmk",
        "caption": "‚ÄúThe school wanted to create some new after-school programs. I‚Äôd run track in high school. Was I good? No. But I ran. So I volunteered to create the track program. The minimum to form a team is eight girls. Luckily I‚Äôm a cool teacher. I‚Äôm not rushing them to be grown. And I know the memes. So I had some girls who signed up just to be around me. In the end I found my eight. Nobody had any track experience. But these girls had playground reputations; they were fast. We just needed to build up our endurance. At our first practice we ran around the track one time, just to see how we were feeling. I ran out front to show them how it‚Äôs done. At one point I turn around-- I got girls walking, I got girls stopping. My goal was just to finish the season. I wanted them to learn commitment. So when they grow up they can determine their own way without somebody pushing them. We were a little nervous on the morning of our first meet. Some of us were panicky. Some of us were crying. I told them: We don‚Äôt need any MVPs. We don‚Äôt need any Rookies of The Year. Just don't stop running. No matter what‚Äîjust don't stop running.‚Äô All of them raced in different heats. Then the scores started coming in; it was like: ‚ÄòWhoa. What‚Äôs up. We winning this?‚Äô A lot of the girls placed. Our captain Jaziah was second out of 24 girls. That was the day we became a team. I started buying Gatorade. We chose a team name. Every time I gave a suggestion, they‚Äôd be like: ‚ÄòThat‚Äôs corny. That‚Äôs corny.‚Äô They‚Äôre in that phase of like, they hate everything. But when we got to ‚ÄòBaby Got Track,‚Äô that hit. BGT, baby. BGT. Now before every meet we do our BGT chant to give us a little bit of that braggadocious energy. These girls are committed. During the 7th grade trip to the Poconos, the BGT girls were in my cabin. We woke up an hour early, ate breakfast, brushed our teeth‚Äîthen we ran track. Tomorrow is the championship. We know that we can do it and we‚Äôre gonna show that we can do it. But no matter what happens, these girls are already leaders in the middle school. Our principal has noticed the results. We‚Äôre getting brand new jerseys. And next year we‚Äôre going to have an indoor track team too.‚Äù",
