        "shortCode": "CtrcCUTr1Mm",
        "caption": "‚ÄúEverybody gets butt hurt over words. The ‚ÄòMe Too‚Äô movement was necessary. That was good. But then it just turned into everybody getting way too sensitive. You‚Äôve got these people trying to create a bubble-wrapped world where they‚Äôre never going to hear a word that hurts them. Just so they can always be comfortable. It‚Äôs human nature to want to be comfortable. No problem with that. But if something makes you uncomfortable, you don‚Äôt get to make a rule that the rest of the world can‚Äôt say it. I give it another two or three years. There‚Äôs no way it can last. It‚Äôs happened over and over again throughout history: people get soft, then they get hard again. Just wait until the next really deep recession. It‚Äôs going to seem pretty self-indulgent to obsess over other people‚Äôs words. People are going to get strong again. And that‚Äôs good. I like strong people. It‚Äôs not that I dislike weak people. I just like strong people more. I was with my friend Christina the other day. She had her little boy with her, and she‚Äôs letting this kid run into everything. He‚Äôs running into things with his face and his head and his body. And Christina is letting him, because Christina knows. She went to state, she went to nationals. She almost became a professional softball player. Christina knows what it takes. And she doesn‚Äôt want her kid to be soft. That‚Äôs what I like. I like people who don‚Äôt want a trophy just for showing up. I like people who can hear a joke, or even an insult. If the words aren‚Äôt true then they shouldn‚Äôt bother you. But if the words are true‚Äî they should sting. Don‚Äôt hide from the sting. Embrace the sting. Feel the sting of the words and say: ‚ÄòI don‚Äôt like this.‚Äô So I‚Äôm going to become a better version of myself-- mentally, emotionally, spiritually, physically-- until the words don‚Äôt sting anymore. Don‚Äôt hate yourself. Never hate yourself. Just hate the person that allowed you to become what you were, before ten seconds ago. Before you felt the sting. That person is disgusting. That person is unacceptable. That person must be destroyed.‚Äù",
