        "caption": "‚ÄúIt started with a joke about pansexuals. Something about defending your kitchen from pansexuals. Then one of my classmates accused me of belittling them. Which turned into a bigger conversation about homophobia and racism. People began sharing their own experiences with discrimination, and honestly, a lot of it seemed overblown. It‚Äôs like: C‚Äômon. You live on the wealthy side of town. What you‚Äôre describing sounds like an everyday disagreement between two humans, but you‚Äôre bumping it up to discrimination. That‚Äôs when people started accusing me of discrimination. I pointed out that I was Jewish. But they said my trauma was generational and not first-hand, so it didn‚Äôt count. All of it just seemed like some sort of competition. A twisted game where the more discrimination you could claim, the more social points you won. It ended up with everyone ganging up on me and calling me racist. And that started me on a journey of watching alt-right videos. It just felt good to hear people say: ‚ÄòIt‚Äôs not you, it‚Äôs them. Those blue haired people, with their thirteen pronouns-- they act like they‚Äôre morally superior. But it‚Äôs all about power. They want to shame you into silence.‚Äô The videos always used the word ‚Äòthey.‚Äô ‚ÄòThey‚Äô are ruining this country. ‚ÄòThey‚Äô want to take away your rights. No matter how many types of people were being described, it was always ‚Äòthey.‚Äô It made it easy for me to dismiss discrimination whenever it was claimed, by anyone. I‚Äôd think: ‚ÄòThere they go again.‚Äô I‚Äôm out of that phase now. If anything I‚Äôm politically active on the other side. I‚Äôm thankful it happened to me when I was fourteen, and still growing. Because if I‚Äôd been older, working some dead-end job, not meeting people‚Äî it would have been harder. Because one thing that really helped me was one-on-one conversations. My more moderate classmates started talking to me again. A few of them even apologized for how it all went down. They didn‚Äôt speak as a member of a group. It was just: ‚ÄòThis is who I am. This is how I experienced discrimination.‚Äô It wasn‚Äôt hostile. I didn‚Äôt feel ganged up on. And I was able to hear them. I‚Äôve learned that for a lot of people, it‚Äôs not a game. It‚Äôs their lives.‚Äù",
