        "shortCode": "CxGt2KLuyBu",
        "caption": "(15/54) ‚ÄúAfter my injury Mitra said it was finally time to be realistic. She began to use the words I would hear for the rest of my life: ‚ÄòYou‚Äôve already lost one eye for your ideals.‚Äô I‚Äôd always respond the same way: ‚ÄúI‚Äôve still got one eye left. And I‚Äôd like to see the world for as beautiful as it is.‚Äô When we came home from Germany I promised that I‚Äôd never leave Iran again. Not even once. Not even on vacation. The only job I could find was at a steel factory. It wasn‚Äôt my ideal position. But wherever I am, I think of all of Iran. It was my hope that I could gain some experience and spearhead an industrial policy for the entire country. Inside the house Mitra was queen. She wanted everything in our house to be beautiful. She‚Äôd make entire booklets of beautiful things that she‚Äôd clipped from magazines: one for couches, one for lamps, one for tables. Mitra chose all of the children‚Äôs clothing. Sometimes they‚Äôd miss their bus because she was so particular. And whenever she decided‚Äîit was final. I tried to teach the children to use their voice. I‚Äôd tell them: ‚ÄòIf you disagree with what I say, use your words.‚Äô But Mitra was the opposite. She wanted her word to be the law, and that also applied to me. We once went to a famous carpet store in Tehran. Inside there were many beautiful trees. When Mitra asked the owner how he kept them so green, he said that every time he finishes a kettle of tea, he pours the remains on the roots of the trees. From that day on, Mitra made me pour the remains of our tea on the roots of our trees. She‚Äôd send me out in the middle of the night to do it. I tried to appeal to her reason. I told her that it made no sense. It was nonsensical. But inside our home her word was the law. Only once did I make a stand. When our youngest daughter was born, Mitra wanted to name her Kakoli‚Äîit‚Äôs a beautiful little bird with a plume on its head. But I had a different idea. We argued about it for weeks. And in the end we made a compromise. We agreed to call her Kakoli. But her name, would be Gordafarid.‚Äù",
