        "id": "3122970087367809549",
        "type": "Image",
        "shortCode": "CtXBL-NupoN",
        "caption": "‚ÄúI‚Äôve never been a sports person. But I just spent three years locked in my apartment. I‚Äôve cycled through all the arts and crafts already: painting, ceramics, you name it. So I wanted to try a sport. And let me tell you-- it‚Äôs a whole new level of pressure. Because there are other people involved. They told me that pickleball was a sport anyone could play. I took them at their word, and it‚Äôs been torture ever since. I started with a class at the YMCA; they advertised for people with ‚Äòmixed abilities.‚Äô But when they say ‚Äòmixed,‚Äô that means mixed with advanced people. During my first game I flew. I mean I actually flew. Balance is a big issue at my age. If you don‚Äôt balance, you fly. And I flew. The teacher said: ‚ÄòIf it‚Äôs out of your range, just let it go. Let it go.‚Äô Everyone was sympathetic. I think they were impressed I didn‚Äôt go straight home. But after the first game, you know, people have expectations. I couldn‚Äôt serve, I couldn‚Äôt return. Nobody said anything. But when there‚Äôs a bunch of stuff you‚Äôre supposed to do that you can‚Äôt do, and every time you play, your side is zero--- people start to notice. They try to act like they don‚Äôt care. But this is New York; there‚Äôs limited time on the courts. They care. So after my third game I was like: ‚Äòsee you later.‚Äô I signed up for clinics at the rec center. Then I found a nice spot in Jersey where nobody was playing. Lots of wall. Lots of space. Perfect for me. I even got in a few serves. And that was fighting the wind, because it was right on the water. Of course as soon as I got back to the clinic, I couldn‚Äôt do it. But I‚Äôm going to keep trying. All I care about is having good form and enjoying the game. Winning isn‚Äôt important. I‚Äôm not a competitive person. But I‚Äôm the kind of ‚Äònot competitive‚Äô that‚Äôs not competitive because I know I‚Äôm going to lose, so you know what? Yeah, I‚Äôd like to win one. It would be nice to win a game. I just have to get through all this other stuff to get there.‚Äù",
