        "caption": "‚ÄúWhen he was born I took him see his grandfather. I brought him to the construction site where he worked, so they could meet. But my dad didn‚Äôt even make an effort. It was the same thing I remembered from my childhood. Never once do I remember: ‚ÄòOh, let‚Äôs go to the water park.‚Äô He‚Äôd spend all his money on friends and girls. And when he did come home he was always screaming, always hitting. For every little thing: if we didn‚Äôt brush our teeth, if we didn‚Äôt help out enough around the house. He treated my mom bad too. I tried to stop it. When I got older people would have to physically separate us. The anger is in me too. It comes from the inside. I‚Äôll start to get mad, and suddenly it‚Äôs all over me. But whenever that starts to happen, I think: ‚ÄòI‚Äôm not going to be him. I‚Äôm not going to be him.‚Äô I‚Äôll walk away and calm down. Then I‚Äôll come back and apologize. I‚Äôll say: ‚ÄòWhat you did was wrong. But it was also wrong for me to speak that way. And I promise not to be like that again.‚Äô I try to show him respect. Even though he‚Äôs a kid, he deserves the same respect as any person‚Äî even more, actually. Because an old person knows what‚Äôs going on, and he doesn‚Äôt. I always say goodnight with a kiss. And I just try to be as patient as I can. Always, always, always. I can read the way he is. Like, he doesn‚Äôt need to tell me if something is bothering him. Because I can see it in his face. He‚Äôs a super kind boy. I haven‚Äôt noticed any anger in him at all. Not at all. Sometimes I worry, that I need to push him a little harder to be tougher. Because he‚Äôs just so kind--- I mean, look at him. Look at him.‚Äù",
