        "caption": "‚ÄúYou have to be like super different than any other teenager to get into a good college. But I don‚Äôt do many extracurriculars. So I‚Äôve been focusing on my college essay. Our English teacher gave us this exercise to come up with ideas. We had to list all the letters from A to Z, and write words for each letter that relate to you. But I‚Äôd already thought about this a lot, so I just skipped straight to Z and wrote zombie apocalypse. First of all‚Äî I used to be scared of zombies. But now I‚Äôd love to be in a zombie apocalypse. So that demonstrates how feelings are, like, not permanent. Plus a zombie apocalypse would really highlight my strong points. It‚Äôs like a live-or-die type situation. You have to survive with a small group of people. In class I sometimes think about which group of people I‚Äôd choose to be with. I‚Äôd be the perfect one to assign roles because I like judging people. Someone will need to be the explorer. Another person needs to be the government kind of person. Then you‚Äôve got to think really hard about the weapon assignments. Luckily I think about it all the time. Personally I‚Äôll take the pistol because it‚Äôs really light weight and would allow me to keep moving. This is my friend Jiahao; I‚Äôd give him the axe. He likes to face things head on. So I think he‚Äôd really shine in close combat.‚Äù",
