        "caption": "‚ÄúHis mother wanted a break. You know, it‚Äôs hectic. She‚Äôs a single mother. She just bought a house. It‚Äôs a lot taking care of a kid on your own. She thought maybe it would be a good experience for him to come live with Uncle Olasegun for the summer. As soon as she suggested it, I was like: ‚ÄòI want to do this.‚Äô And here‚Äôs the reason: she did the exact same thing for me. We lost our mom when we were kids. I was really young at the time‚Äî like three. Whitney was twelve or thirteen. She and my other sister ended up taking care of me: cooked for me, took me to school, made sure I had a shower, brushed my teeth. Back then I thought she was annoying, because of my ignorance. But now it‚Äôs crazy for me to think about. It must have been such a burden. She‚Äôd be hanging out with her friends, and I was always there. So I‚Äôm just trying to pay it forward. I picked him up from the airport last night. I have no idea how the summer is going to go. I like to cook, so I‚Äôll cook for him. Maybe we‚Äôll paint a little in the evenings. I‚Äôm going to teach him some kickboxing on the terrace; hopefully that‚Äôll tire him out so that I can get some work done. I‚Äôd love to be a father one day when I find the right woman. So it‚Äôs going to be a good test for me. I‚Äôm just hoping he has fun. And when he goes back home, he tells his mother all about the amazing summer he had with his uncle.‚Äù",
