        "shortCode": "Cs9tEkkLbPc",
        "caption": "‚ÄúYou don‚Äôt want them to grow up materialistic, but it‚Äôs all around them. You try to keep their self-esteem high. Let them have the latest clothes, a decent phone. But that costs money.  I spend a lot more time making it than spending it. They say it's 40 hours but it‚Äôs really 60 hours. It takes an hour to get up, an hour to get to work, then you take your hour to get home. Once you‚Äôre home you get to spend a little time, watch a little TV, kiss, go to sleep. That‚Äôs 5 days a week. Then on the weekends you‚Äôre tired, but you try your best to do something memorable. Because disappointing your kids is one of the most painful things-- period. We just played basketball for these two prizes; my son will remember that. But blink your eyes and the weekend‚Äôs over. And it starts all over again. It‚Äôs the matrix. If I‚Äôd bought bitcoin ten years ago, or my stock portfolio was rolling in, I‚Äôd be doing two things right now: exercising, and spending time with my family. That's it. They say money doesn‚Äôt buy happiness, but it sure would help.‚Äù",
