        "shortCode": "CsZPFHNO1EY",
        "caption": "‚ÄúIt had to be terrifying for my parents. They came from St. Kitts with nothing. It was moment-to-moment, paycheck-to-paycheck. At one point we were living in a one bedroom apartment with eight kids. It was chaos. There was always something happening: fighting over the remote control, or whose clothes, or whose shoes. But we also had each other for happiness. All of us were going through the same thing. The whole family shared a single camera-- a point and shoot. Everybody got a turn. And it got used a lot. Today if you go into my home, or my dad‚Äôs home, you‚Äôre going to find a bunch of albums. Whenever we get together, we'll take them out. It's mainly just photos of the day-to-day stuff: birthdays, holidays. Maybe a picture of us all sitting at a table, eating a meal. But if you think about it real quick: that's what life really is. Some of my happiest moments are just eating with my family. Food, laughter, and a lot of people. That's love to me. Nobody‚Äôs thinking about what happened before we sat down. Nobody‚Äôs worried about what‚Äôs going to happen when we leave. We just trying to get this food.‚Äù",
