        "shortCode": "CsHPCxYOxGX",
        "caption": "‚ÄúWe were high school sweethearts. He came up to me in the hallway one day and I said: absolutely not. I was an honor student. He was smoking weed, running around, getting in trouble. My parents moved our family away from the inner city for a reason‚Äîand it was to get away from all that. But I knew his family. I knew where he‚Äôd come from. And also: sometimes I can see things. I‚Äôd pay attention. I‚Äôd watch him with his friends. And I could tell: this is not him. I knew he didn‚Äôt see himself in that space forever. And that‚Äôs been the most beautiful thing, of like, everything. Watching that transition. Seeing it all from the beginning: him figuring out that he was worthy of more. It took a while. There were times he messed up, and I won‚Äôt make excuses for that. There were lulls. We‚Äôd date other people for a while, but every time he‚Äôd come back hard. And not just like: ‚ÄòI‚Äôm sorry, babe. Please take me back.‚Äô He‚Äôd put in more effort. He‚Äôd grow. And now he‚Äôs gotten to a place where he has a much better understanding of his existence. He‚Äôs a vegan. He meditates every day. And he‚Äôs very serious about it; he‚Äôs descriptive about the reasons he changed his life. A lot‚Äôs been thrown at him recently. Both of us work at underprivileged schools, which can be exhausting. But I‚Äôve seen him stay up for twenty-four hours, go to work, then come home and still be present. He‚Äôs a nurturing father. He‚Äôs a protector. It wasn‚Äôt always in him. But it‚Äôs in him now. And not to toot my own horn, but I saw it. What I saw was this. Exactly this.‚Äù",
