        "shortCode": "CsefsFhuxDo",
        "caption": "‚ÄúMy grandmother had this big, antique mirror that she let me keep in my room. I‚Äôd stand in front of it for hours, pretending to be my favorite artists: Dionne Warwick, Barbra Streisand. I‚Äôd listen to their records over and over and mimic them. I wasn‚Äôt thinking if my voice was good or bad. I was just enjoying myself. That was my escape. It was dark in that house. There were times I‚Äôd be sitting in a sunny spot, and a giant shadow would crawl across the floor. I‚Äôd watch it closely. I didn‚Äôt understand the meaning exactly back then. But somehow I knew: whenever there‚Äôs darkness, there‚Äôs light too. Behind the house there was a garden. It was a lush garden; my grandmother was a beautiful green thumb. I‚Äôd look at all the flowers. I‚Äôd study the shape of their leaves. I‚Äôd spend hours watching bugs. The house backed up to the Van Wyck Expressway. So I‚Äôd climb up in a tree, and watch all the people go by. I was just going through so much, you know. Horrible things were being done to me. Horrible, terrible things. So I‚Äôd use whatever I could. I‚Äôd pay attention to anything that made me happy. That‚Äôs one thing I can do: pay attention. It comes from something within me. We all have it. But you know, I tap into it. I still do. I just took a picture of a flower this morning. I‚Äôm so grateful. I‚Äôm telling you, I‚Äôm so grateful that I came out of the darkness. Maybe my journey wasn't to make money or to be successful or anything. It was just to recover. I have children now. I have grandchildren. I love to bake. I‚Äôm an educated woman. I read, I write. I went to college in my fifties and graduated with a 5.0. My kids are proud of me. And I‚Äôm a great singer, too. In college the students would all beg me to sing. They‚Äôd say: ‚ÄòTorria, Torria. Sing to us, please.‚Äô Just one song. That‚Äôs how much they loved my voice.‚Äù",
