        "type": "Image",
        "shortCode": "CsUBMSouQj4",
        "caption": "‚ÄúI used to say: ‚ÄòI like to watch TikTok, or YouTube.‚Äô But I don‚Äôt really like to describe myself that way anymore. Because if you think about it, that‚Äôs not really something you do. It‚Äôs just something that pulls you in. It made me feel connected. Like, I know this person. But I really didn‚Äôt know them at all. And I‚Äôd sit at home getting sucked into this endless void of whatever I was watching. Windows closed, AC on. My dad would say: ‚ÄòGo outside and do something, it builds character.‚Äô Most of the time he‚Äôd only say it because he wanted me to take out the trash, or go on an errand with him. So for a long time I didn‚Äôt think it meant anything. But it really does, if you think about it. Because every time you do something, it adds to who you are. You learn from life. Recently I joined a group called The Veggie Nuggets. There‚Äôs seven of us: me, my friends, a couple neighbors. We made a mural. We made a garden over by 69th and the bridge. We lobbied a little bit at the capital for climate change, because it‚Äôs kinda a disaster. I had to develop a certain mindset when I did those things. I had to affirm to something. I had to be motivated. And that‚Äôs a real thing-- motivation. It‚Äôs a trait. And now it‚Äôs part of my character.‚Äù",
