        "caption": "‚ÄúHe‚Äôs going to be‚Äîhe is‚Äîthe man who will dance around the living room with her and make silly faces and tell her silly stories and tell her that he loves her all the time and take her on great adventures and read her amazing stories and make cool shit with her and go on long walks with her and put the world right for her. Just the way they look at each other. She can‚Äôt see shit. But he sees a lot. It‚Äôs different than he looks at me. It‚Äôs so pure. He notices every change in her face. Every noise that comes out of her.  Just having someone doting on you like that. I just think how lucky she‚Äôs going to be. And being able to see that energy between a father and daughter. Even if I didn‚Äôt get to experience that myself‚Äîjust to be around it now, it does a lot of healing for me. I feel like so much is slowly repairing in my cellular being. I lost my dad when I was young. Things were heavy dark. I‚Äôve always associated love with pain and tragedy and loss and grief‚Äîbut knowing that I can let go of that, and experience love in a light and beautiful way. It‚Äôs exciting. Like, love is fun. Love is pretty fucking fun.‚Äù",
