        "shortCode": "CrLpvTfuyrd",
        "caption": "‚ÄúWe have a cabinet in our apartment called The Witch Cabinet; it‚Äôs full of knick-knacks: tarot cards, random rocks, bottle caps, buttons; there‚Äôs a whole beaver skull in there. Our walls are covered in murals. Our window sills are covered with random bunches of dried flowers that we meant to put in jars. She could describe the relationship better. She‚Äôs better with words than me. But if there‚Äôs such thing as a platonic soulmate‚ÄîEmme is that. She‚Äôs the first person I send anything. My God, absolutely anything: I want to try this video game, I want to try this recipe, I want to try this restaurant‚Äîso you‚Äôre going with me. I have a favorite podcast called The Old Gods of Appalachia. Emme‚Äôs never even heard of it. But they‚Äôre having a show tonight, and she‚Äôs coming along. We‚Äôve been roommates for seven years. It's the first time I‚Äôve ever lived in a home where I was allowed to speak up about things that bothered me. Emme taught me how to do the ‚Äòfriend call-out.‚Äô You know, like: ‚ÄòYou‚Äôre my best friend. But what you‚Äôre doing is really fucking shitty.‚Äô The first time it happened, it was a big ‚Äòoh yeah‚Äô moment for me. Like, oh yeah: there‚Äôs a way to talk about hard things without yelling at each other, or ignoring each other. She‚Äôs helped me work through a lot of stuff. And I‚Äôve tried to help her with some things too. She‚Äôs not exactly where she wants to be right now; sometimes she blames herself. It‚Äôs like, girl-- you‚Äôre the hardest worker I know; it‚Äôs obviously the fucking job market. She also has no idea how pretty she is. It‚Äôs like, girl‚Äîare you seeing what I‚Äôm seeing? Then one time she actually said: ‚ÄòI‚Äôm not that fun.‚Äô Not that fun? Girl, you light up a fucking room.‚Äô‚Äù",
