        "shortCode": "Cr_VBBGr94R",
        "caption": "‚ÄúHe‚Äôs a dangerous man. In December he came to visit. At the airport he opens the door of the Uber, and it hits another car. The driver starts screaming: ‚ÄòYou broke my car!‚Äô I pull the guy aside, and I tell him: ‚ÄòPlease, not this man. Not this man.‚Äô This man doesn‚Äôt care about nothing in this world. All that matters is his family. If my mother is happy, his kids are happy‚Äî fuck the rest of the world. When I was young he opened a restaurant in Genoa. He bought it for cheap; it used to be a Chinese restaurant. There was a giant dragon on the wall. He couldn‚Äôt afford to renovate. So he just left the mural on the wall, and named his restaurant The Dragon. After one year the restaurant failed, so he went to work on a cruise line. Every birthday, every Christmas, he was away from us. But blood is blood. The loyalty was always there. I took from him a lot of things. I never cry in my life. I solve every problem, every stuff, every bullshit. One year we have a soccer tournament in our town, for Italy‚Äôs accounting companies. My friend works at one of the biggest, and he tells me: we need a goalkeeper. So they give me paperwork for this fake internship. I show up covered in tattoos. We win every game. And after the tournament they give me a job for real. You have to take seven exams to get this job. Me? I do nothing. But the bosses know I have strong character, so they hire me. Now I am best in my company. Now I‚Äôm in America. I‚Äôd never left Italy in my life, not even on holiday. But I‚Äôm here. And I make a lot of money. A lot. The dragon is a promise. When I go back home, I‚Äôm going to buy back the restaurant. It won‚Äôt make money; but I don‚Äôt care. I only care that its ours.‚Äù",
