        "shortCode": "CrgikkmOHIj",
        "caption": "‚ÄúMaybe something happened. Maybe I‚Äôll be driving to the softball game, and I‚Äôm sad. Cause something bad happened. I‚Äôm gonna keep that moment kinda private. If I need to talk through it, I‚Äôll call someone. So when it‚Äôs time to step out of the car‚ÄîI‚Äôm happy. I like to keep that image. This guy Jay, he‚Äôs always happy. If you talk to Jay, he‚Äôll brighten up your day. Sometimes it drives the guys at work crazy. I work in Sanitation. Our shift starts at 5 AM. These guys are coming in from all over: they‚Äôre tired, they‚Äôre dragging. But I‚Äôm whistling. I‚Äôve got my Dunkin Donuts coffee. I‚Äôm saying: good morning, bro. What‚Äôs up? We‚Äôre about to make some money. Good, honest day‚Äôs work. Every time you get to the end of the block, you look back. You see the whole block is nice and clean, the sidewalk‚Äôs nice and clean. So I‚Äôm smiling. The guys call me Smiley. Billy started that. He said I‚Äôm the only one who comes to work smiling. But I‚Äôm like: how can you not be happy? Maybe it‚Äôs just the way the dominos have fallen for me. I have great friends, a great career, a great family. My brother is like my best buddy. Been dating a girl for three years. She teaches dance to little kids. We go out dancing together, salsa dancing. Yo, she‚Äôs great man. It‚Äôs like, how could I ever have a bad day? Been that way since I was a kid. Nobody could put me down. In the morning I‚Äôd be like: Another day of school? Let‚Äôs do it! And listen, when I got home, if Grandma made the skirt steak. With the rice and beans, and the plantains. She‚Äôd be like: yo, Jay. Tonight I made your favorite. And bro, I would get hyped.‚Äù",
