        "shortCode": "CoIVgbIuJzo",
        "caption": "‚ÄúWhenever there was an event at school, he‚Äôd come straight from work. Wearing these heavy blue coveralls. Stomping around in these big, chunky boots. He‚Äôd have a tag with his name on it: Herbie‚Äî written big like. He was always so noticeable. That‚Äôs the main thing I remember: the other parents seemed smaller. Maybe not smaller, but sleeker: tight button-tops, khakis. I was one of two Hispanic kids in my grade. I‚Äôd only gotten in through a program that sends black and brown kids to private school. But I never felt discriminated against. We all loved the same video games and YouTube videos. Within a few weeks I was going to friends‚Äô houses for sleepovers. These houses were humongous. Everyone had their own rooms. Then I‚Äôd go back to our house, in the Hispanic neighborhood. And it was just a square with a triangle roof. And we had like ten people living there. It was different. Behind closed doors, I knew we were different. And that juxtaposition was a little too much to overcome in my head. I felt like if I wanted to fully step into this new role, I needed to shed all that. I‚Äôm on the other side of it now. I graduated from a private university. I‚Äôm working at a tech start-up. I feel like this was it. When my parents came over, this was their intention. I‚Äôve fully assimilated. But now that I‚Äôm here, I kinda miss what I‚Äôve left behind. I‚Äôve lost it. It‚Äôs not that I chose another culture. My life just got filled with other stuff, and I let it go by the wayside. I don‚Äôt even really speak Spanish anymore. Maybe in very small bursts, or whatever. But I miss the curse words, the slang. I miss it being commonplace. Mainly I just miss being around people like me: feature wise, and stuff like that. At least now that I‚Äôm in New York, I can take the train home every other weekend. It‚Äôs like a celebration, every time I come back. We don‚Äôt all live together anymore; but the whole family‚Äôs nearby. Everyone comes over. My dad grills out: steak, tortillas, vegetables. Eating home cooked food, it‚Äôs like I‚Äôm a kid again. It‚Äôs healing in a way. It feels right. Knowing I‚Äôm in a good spot. I‚Äôve gotten to where I want to be, but I‚Äôm back with the people that I‚Äôve always been with.‚Äù",
