        "shortCode": "CnhVPz9OVhn",
        "caption": "‚ÄúI worked as a legal assistant for 50 years. And I‚Äôve always been lucky to work for honest, kind, brilliant attorneys. All that paperwork might seem boring to other people. But I never even took lunch, that‚Äôs how much I loved it. I loved the law. It‚Äôs very precise. My work needed to be exactly right. And there was a lot of pride there. But something seems to have changed in the culture. So many of my coworkers would rush out the door at 5 o‚Äôclock. With important, unfinished things on their desk. In law you have to get things out quickly, but it‚Äôs like they just didn‚Äôt care. Maybe it‚Äôs a generational thing. I‚Äôm older, I‚Äôm 77. So maybe there‚Äôs something I don‚Äôt get. ‚ÄòQuiet quitting,‚Äô and all of that, I just don‚Äôt understand it. If it‚Äôs just a paycheck to you‚Äîif you‚Äôre getting by on the minimum, and not trying to be perfect, or God forbid, if you're screwing it up on purpose-- why are you even going to work? Save your pennies and quit. Find something else you can take pride in. If you‚Äôre spending eight hours a day on something you don‚Äôt take pride in, it seems to me that somewhere, deep down inside, you‚Äôre a phony. Maybe not a phony. But you‚Äôre deluding yourself. It‚Äôs going to spill over into the rest of your life. And there‚Äôs not enough money for me. Well, $20,000 a week maybe. But otherwise there‚Äôs not enough money for me to not take pride in my work. I couldn‚Äôt do it. I know that sounds ridiculous, but I can‚Äôt. You know how people text, and there‚Äôs like spelling mistakes and grammar mistakes and everything? Not me. I‚Äôll reread everything. I‚Äôll go back and fix it, I‚Äôll put in the comma. That‚Äôs who I am. You either have it or you don‚Äôt, and less people have it now. I think it was the digital revolution. When I first started working there were typewriters. If you made a mistake, you had to redo it. You had to be careful, you had to get it right-- until the computer came along. I remember my boss was so excited about the computer age. He said: ‚ÄòIt‚Äôs going to be great! We‚Äôre going to have a paperless office!‚Äô I knew better. I told him: ‚ÄòThere‚Äôs going to be a lot more paper, actually.‚Äô Because you can reprint everything. And nobody‚Äôs going to care anymore.‚Äô‚Äù",
