        "shortCode": "CmMpQJfNn4-",
        "caption": "One of the coolest parts of Humans of New York in the early days was HONY For The Holidays where we‚Äôd match up people with nowhere to go on Christmas with people who had an extra place at their table. The idea originated from my first year in NYC, when I didn‚Äôt know anyone, and didn‚Äôt have money to go back home‚Äîso I spent Christmas Eve at a 24-hour diner. (I say that only because there is no shame if you don‚Äôt have anywhere to go. We all have seasons.) My lovely wife Erin handled the matching and logistics for the initiative, on top of her main gig saving the lives of one gajillion senior dogs at @susiesseniordogs. But over the years the Stanton household grew, way led on to way, and alas, the HONY For The Holidays candle flickered out. But hark, hark! Hear ye angels sing. Our patron saint Mary O has decided to host her own HONY for the Holidays Dinner at @maryosirishpub this year, on Christmas Day. And boy is she excited. Giddy, really. Rarely is Mary not merry. But this is a very merry, very cheery Mary. In fact I'm 90 percent sure she's crying right now as she reads this. ‚Å£\n‚Å£\nMary would like to invite anyone who has nowhere to go this Christmas to join her for this magical event. There is currently room for 45 people. That was Mary O‚Äôs idea, because: ‚ÄòIt‚Äôs not a round number. And that makes it seem like really something. Ya know?‚Äô She will be cooking herself. I tried to force catering on her, because she‚Äôs STILL baking scones 18 hours a day, but she said: ‚ÄòThat just doesn't feel right. It wouldn‚Äôt be the same, ya know?‚Äô (This is coincidentally the same reason she gave for baking one million scones herself. She's nearly 80 percent through, for anyone still waiting: 'But my hand has touched each one.')‚Å£\n ‚Å£\nIf for any reason you find yourself alone this holiday season, and are in the NYC area, please email a little about yourself and your situation to honyassist@gmail.com. And we'll try to get you a spot at Mary O's. We'll fit as many as we can.",
