        "shortCode": "CnPTm0HOep5",
        "caption": "‚ÄúMy parents used to tell us: with what little you have, be a blessing to others. But my father also said this: don‚Äôt let people smell your money. I didn‚Äôt know what he meant. But what he meant is: when you have things, don‚Äôt announce it. Because once you announce it, people smell it. The aroma gets in them, and they start to make it theirs. They‚Äôll start to think: I need it more than him, he can give some to me. And they‚Äôll come up with a thousand reasons to get it from you. Don‚Äôt get me wrong, they‚Äôre real reasons. But six months later: here comes another one. You‚Äôd think that the more you do, the less you‚Äôll need to do. But it doesn‚Äôt seem to work that way. With a lot of people, the more you do, the more they seem to need. It‚Äôs not good psychologically. And it‚Äôs not good economically. For my whole life I‚Äôve been the person people come to. But I‚Äôm almost sixty now. I‚Äôm not where I want to be, so I‚Äôm slowing down on the giving. I still want to be a part of the whole thing: pay it forward, be blessed to be a blessing. God is love, but God is also discernment. And I can‚Äôt let other people‚Äôs emergencies cause me to have an emergency.‚Äù",
