        "caption": "‚ÄúI used to be the one that people came to for everything. Recently my sister Ayla turned sixteen, and I helped her get a job at the sneaker store I used to work at. So there‚Äôs still some stuff I can do. But not a lot. I was at the bodega earlier today, trying to reach for shit. A complete stranger had to help me. I know it‚Äôs a great thing to help someone who‚Äôs disabled, or elderly. I used to do it all the time. But I‚Äôd always feel bad for that person. And that‚Äôs what I don‚Äôt want. I don‚Äôt want people feeling bad for me. Maybe it‚Äôs a man thing, or a pride thing. But I just rearranged my whole apartment by myself, in a fucking wheelchair. Not to bother people. Not to have anyone feel bad for me. Sometimes I‚Äôll break down, but I do it by myself. Mainly at night. And even then-- I‚Äôll give myself probably five, ten minutes to feel bad, but that‚Äôs it. I‚Äôll start to think about my family. Like, I care about myself. But I care about my family so much more. And I know they wouldn‚Äôt want me in this place, so that‚Äôs what really pulls me through. I‚Äôll try to think of happy memories. I used to think of shit that happened before the wheelchair, but then it‚Äôd be like: ‚ÄòDamn. I might not be able to do that again.‚Äô So you know what I do now? I think about happy stuff that‚Äôs happened since I‚Äôve been in the wheel chair. Recently my sister had her sweet sixteen party; I was actually scheduled to start radiation, but I made the doctor reschedule. Because I didn‚Äôt want to miss the party. I didn‚Äôt want everyone being like: ‚ÄòWhere‚Äôs Craig? Where‚Äôs Craig?‚Äô I didn‚Äôt want Ayla explaining my situation, thinking about my situation. So I made sure to go to that party. All my boys came through; they all knew my sister since she was young. The whole vibe was good. Nothing felt forced. I didn‚Äôt get treated no different. On the last song of the night, they dragged me out on the dance floor. And I popped up a wheelie. The DJ was yelling: ‚ÄòDon‚Äôt drop him! Don‚Äôt drop him!‚Äô I was a bottle of Hennessy in, so I almost busted my ass. My friends were laughing at me, talking shit. Just like they always do. And that‚Äôs exactly what I wanted. Like‚ÄîI‚Äôm in this situation. But I‚Äôm still me. I‚Äôm still Craig.‚Äù",
