        "caption": "(15/15) ‚ÄúThere‚Äôs something I do every morning. When I‚Äôm leaving for work. I‚Äôll go in his room and give him a kiss on the forehead. Now if I was to try this during the day‚Äîhe‚Äôd never allow it. He‚Äôd push me away. But if I catch him right when he wakes up, he‚Äôs disoriented. I think he forgets who he is for a second. And he‚Äôll hug me like he doesn‚Äôt want me to leave. Next year he‚Äôs going to college. I don‚Äôt like it. It went too fast. It flew. We celebrated my 50th birthday last year. That was a big one for me; it was a birthday my father never saw. We took a trip to Philadelphia: all three of us. Tabatha booked us a nice hotel with an infinity pool. It was just a short trip, and the next morning we drove home. I‚Äôm coming out the elevator, with all of our luggage, when I hear a ruckus in the hallway. I‚Äôm thinking it's kids. I‚Äôm thinking the neighbor‚Äôs kids are playing in the hall again. But then I turn around, and it‚Äôs all of them: Nona, Steve, Anthony, all the nieces and nephews. They‚Äôre filming me and giggling like crazy. I go in the apartment and there‚Äôs decorations everywhere. A beautiful cake. My mother cooked my favorite braciole. In the living room there‚Äôs a bunch of gifts. I sit down on the couch to open them, and Tabatha slides a Bluetooth speaker next to me. It‚Äôs playing Billy Joel songs: Rootbeer Rag, Nocturne. Some of my favorites. But different versions, with different chords. When the final present is opened, I give a little speech. I thank everyone for coming. Then it was time for the braciole. I started heading for the kitchen, when Jack says: ‚ÄòWait. There‚Äôs more.‚Äô My niece disappears into the bedroom, and comes back with our electronic keyboard. She sets it down in the middle of the room. And Jack takes a seat. And he begins to play. The left hand running down the keys. The right hand running up the keys, playing the happy notes. I sit back on the couch and I start to lose it. Nobody else knows what‚Äôs happening. They‚Äôre confused. It‚Äôs just a song to them. They‚Äôre looking at me like I have seventeen heads. They couldn‚Äôt know. He actually did it. My boy. To make me happy. To make me say wow. My boy. My beautiful boy. My beautiful, beautiful, baby boy.‚Äù",
