        "shortCode": "CmFSBB7uDzL",
        "caption": "(9/15) ‚ÄúEvery Santa gets a handler: to walk him to his chair, to bring him water, to give him Tic Tacs. But nothing in Santaland is called by its actual name. Santa handlers are called straw bosses. It‚Äôs an old circus term, for people who handle the elephants. I made sure that my straw boss knew: when the Tammaro family arrives, bring them straight to my house. My son came bounding in first. He was four years old. He jumped in my lap and started telling me his list. But in the middle he stops, and says: ‚ÄòHey! You sound like my Daddy!‚Äô I started to panic. That‚Äôs when my brother Steve stepped in. He said: ‚ÄòIt doesn‚Äôt sound like your Daddy, Jack.‚Äô And I made it through the rest of the visit. But I never risked it again. I didn‚Äôt want to ruin the magic. Jack would write these letters to Santa. He never went straight to the toys. He‚Äôd write things like: ‚ÄòHow is your wife? Are the reindeer OK? Did you go on vacation?‚Äô Only then would he get to the list. He had such empathy. I like to think we had something to do with it. The way we are at home. We don‚Äôt like to argue. We keep it calm, cool, and collected. We have this thing called ‚ÄòFamily Sandwich.‚Äô One day Tabatha and I were hugging in the kitchen, and Jack came running up behind us, and hugged us both. He screamed ‚Äòfamily sandwich!‚Äô And it stuck. We still do it today. I was never a sports dad. But that‚Äôs ok, because he wasn‚Äôt a sports kid. We loved doing legos. In the beginning he‚Äôd just watch me do them. But as he got a little older, we started doing them together. The holidays were always rough for me. It was the busiest time a year at both my jobs, so I‚Äôd barely be home. Jack and I would be watching a holiday movie on the couch, his head on my chest, and I‚Äôd have to get up to go to work. He‚Äôd pull me down by the shirt and say: ‚ÄòDon‚Äôt go.‚Äô He knew that I worked at Macy‚Äôs during Christmastime. But I told him that I worked in Men‚Äôs shoes. I told him that I needed the extra money to buy everyone presents. Every day when I started my shift at Santaland, I‚Äôd take a little lego Santa that we‚Äôd built together, and I‚Äôd place it on the shelf. All the elves knew. The lego Santa‚Äîthat was Jack. It was to remind me of my boy.‚Äù",
