        "caption": "(7/15) ‚ÄúSummer, Highland Falls. One of, if not the best, Billy Joel songs. Lyrically and musically. The left hand goes down the keys, playing the sad notes. The right hand goes up, playing the happy notes. There‚Äôs a point in the song where he says: ‚ÄòIt‚Äôs either sadness or euphoria.‚Äô And that‚Äôs me. That‚Äôs always been me. Tabatha calls me the sad clown. I hit a rough patch after Jack was born. Here was the thing that I‚Äôd always wanted; and there‚Äôs a cloud over me. I was filled with anxiety; I couldn‚Äôt shake it. At work I‚Äôd crawl into the closet with my walkie talkie, just to be alone. On the subway ride home I‚Äôd pull my hat over my eyes. As soon as I walked in the apartment I‚Äôd head straight to Jack‚Äôs room. I‚Äôd lay on the floor while he was napping. It calmed me down. Just to be near him. My beautiful, baby boy. He couldn‚Äôt sleep at night unless I was in the crib with him. After thirty minutes I‚Äôd try to sneak out. But his little hand would come up, and tug on my shirt. And it was back in the crib for me. Tabatha would come in at 4 AM to wake me up for work. I never wanted to miss a single moment. I‚Äôd take him to get the oil changed. I‚Äôd bundle him up, just to take him down the block. We still gathered at my mother‚Äôs house every Thanksgiving-- Anthony, Steve, all the nieces and nephews‚Äîand we‚Äôd choose a day to see Santa. Same thing every year. We‚Äôd always meet at the top of the escalators. But the year that Jack turned three, something strange happened. We were winding through the maze when an elf came bounding up to us. I recognized her; she worked with me at the toy store. She leaned in close, and said: ‚ÄòHi Johnny! Come work with us.‚Äô I laughed. I was thirty-eight at the time. Way too old to be an elf. But too young to be Santa. I didn‚Äôt even consider it. But six months later Tony and Tina‚Äôs Wedding gets cancelled. And the very same week I get an email from Macy‚Äôs, requesting applications for the holiday season. I‚Äôm thinking: this is crazy. I‚Äôm too young. Too skinny. And way too Italian. But when they called me in for an interview, the first question they asked was: ‚ÄòWhy do you love Christmas?‚Äô I looked down at my watch, and said: ‚ÄòHow much time do you have?‚Äô‚Äù",
