        "shortCode": "CmFWMLnO_vU",
        "caption": "(10/15) ‚ÄúThey don‚Äôt give you a pamphlet for it. When they start to click over into adulthood; it‚Äôs like a little death. I‚Äôll never forget the day I brought home a Star Wars Lego set. I poured it out on the table, and started to organize the pieces. Jack was maybe five. He pushed my hand away, and said: ‚ÄòNo Daddy, I do it.‚Äô Oh man. There should be a pamphlet for that. Don‚Äôt get me wrong, it‚Äôs amazing to watch them grow up. Every few months you get to say ‚Äòhello‚Äô to a new person. But you have to say goodbye too. I remember dropping Jack off for his first piano lesson. I printed out the sheet music for Summer, Highland Falls. I slipped it into his binder, and said: ‚ÄòThis is Daddy‚Äôs favorite song. Wouldn‚Äôt it be amazing if you could learn it?‚Äô He rolled his eyes. I said: ‚ÄòC‚Äômon, just one song.‚Äô And he‚Äôs like: ‚ÄòDad, please stop.‚Äô I said: ‚ÄòOK, OK. Just keep it in your binder. In case you change your mind.‚Äô He never changed his mind. But he did start writing his own music. He‚Äôd hear a song that he liked, on YouTube, or one of his video games, and he‚Äôd lock himself in his room for hours. When he came back out he‚Äôd have a written a whole new version. With different chords. It was like: ‚ÄòWow!‚Äô I was proud of him, yes. Of course I was proud of him. Did I wish it had been both of us in that room, singing Summer, Highland Falls?‚Äô Also yes. But no matter how far he clicked over into adulthood, I‚Äôd get him back for five glorious weeks a year. We didn‚Äôt have a fireplace in our apartment. We‚Äôd put the Christmas tree next to a window, and leave the window open. Jack would decorate a plate. Then on that plate we‚Äôd put out Santa‚Äôs favorite cookie‚Äîa big Linzer tart. Also happens to be my favorite cookie. I‚Äôd take a big bite of the tart and make some crumbs, and I‚Äôd drink the milk. Then the next morning he‚Äôd knock on our door at six o‚Äôclock, screaming: ‚ÄòHe came! He came!‚Äô It drove Tabatha crazy. Every Christmas, she‚Äôd say: ‚ÄòIt‚Äôs out of control. You‚Äôre out of control. This is the year we have to tell him.‚Äô Second grade, third grade, fourth grade. Every time: ‚ÄòThis is the year.‚Äô But I‚Äôd always say: ‚ÄòNot yet. When it‚Äôs time, it‚Äôs time. But one more year. Just give me one more year.‚Äù",
