        "caption": "(13/15) ‚ÄúThere‚Äôs a pep rally at the beginning of every season. Everyone‚Äôs there: the white flowers, the straw bosses, the elves. First we go through all the Human Resources stuff. Then the person on stage will pause, and say: ‚ÄòDo I hear jingle bells?‚Äô And everyone goes crazy. Then he explodes into the room, wearing full parade suit. He makes his way to the stage. He recites The Night Before Christmas; everybody‚Äôs crying. Then we all line up, we go through the maze, and everyone has their own private visit with Santa. Look, I know who it is. I‚Äôve had coffee with him. But this mask of sparkle and tinsel comes over my eyes; and I just see Santa. I‚Äôve asked him for some very personal things. Not things, things. Things you can‚Äôt hold. On the night Jack learned it was all a dupe, I was a nervous wreck. A white flower came into my house, and whispered in my ear: ‚ÄòThey‚Äôre here.‚Äô I took a deep breath. And prepared to tell my son that I‚Äôve been lying to him his entire life. Jack comes in wearing my old leather jacket. And Tabatha‚Äôs red scarf. I say: ‚ÄòHello, Merry Christmas.‚Äô And right away, he knows. He says: ‚ÄòWhat the hell, Dad?‚Äô I pat the bench next to me, and motion for him to sit down. I say: ‚ÄòHey buddy, what‚Äôs up?‚Äô He‚Äôs just looking at me. I show him the Lego Santa on the shelf. I say: ‚ÄòI want you to know that I haven‚Äôt been working in men‚Äôs shoes these last ten years.‚Äô And he goes: ‚ÄòReally?‚Äô And I see it. I see it starting to click. ‚ÄòYou‚Äôre right,‚Äô I tell him. ‚ÄòIt‚Äôs impossible for Santa to do what he does in one night. But he did exist. His name was St. Nicholas. And he was so kind, and so giving, that his legend grew over hundreds of years. And now during Christmas, we keep his spirit alive by becoming Santa Claus. Not only am I Santa Claus, but Mommy is Santa Claus. And Nonna is Santa Claus. And Uncle Steve is Santa Claus. And Uncle Anthony is Santa Claus. And now, because you‚Äôre of age, I‚Äôve brought you here. To bestow the power of Santa Claus onto you.‚Äô He started to cry. And I started to cry. And the elves started crying, and the white flower, and the straw boss. Then I looked up. It couldn‚Äôt be. A Christmas miracle. I said: ‚ÄòTabatha, babe. Are you cwying?‚Äô‚Äù",
