        "shortCode": "CmFnWBdNCOU",
        "caption": "(14/15) ‚ÄúNever once have I called him by his real name. He‚Äôs even saved in my phone as Santa. He has a house up north somewhere. I‚Äôll go months without hearing from him, but then he‚Äôll text. And it‚Äôs never just a text. It‚Äôs a long paragraph, starting with: ‚ÄòHello my friend, I hope your beautiful family is doing well.‚Äô One year I had an idea. I told him: ‚ÄòWe do this thing on Christmas Eve, called The Feast of The Seven Fishes. We‚Äôd love to have you.‚Äô I thought for sure he‚Äôd say no. But he replied: ‚ÄòLet me think about it.‚Äô A week passes. Then one night I‚Äôm in my make-up chair, and two white gloves fall upon my shoulders. It was a serious thing. He bends down, looks at me in the mirror, and says: ‚ÄòYes!‚Äô From that moment we started to plan. On Christmas Eve I got to Nonna‚Äôs house early. I told her: ‚ÄòMa, a coworker is coming over dressed as Santa‚Äîto surprise the kids.‚Äô She says: ‚ÄòWouldn‚Äôt that be amazing!‚Äô And goes back to cooking. At 5:30 Santa finishes his final shift at Macy‚Äôs. He hops on The Brooklyn Polar Express, only this time it‚Äôs going the opposite way. Back to my childhood home. Right as we finish dinner, I get a text that he‚Äôs in position. I pull my mother aside. I say: ‚ÄòWe gotta to do it now,‚Äô and I go into the bedroom. When I come back I‚Äôm dressed as an elf. I gather everyone in the living room. I say: ‚ÄòAs all of you know, Nonna has been making Christmas special our entire lives.‚Äô Then I hit ‚Äòplay‚Äô on the TV. I had it all queued up. The Thanksgiving Day Parade‚Äîthe exact moment, when Santa comes into Herald Square. I pause right on a close-up of his face. ‚ÄòTonight,‚Äô I say. ‚ÄòWe do something special for her.‚Äô And then we hear it. The sound of bells. It's coming from the front porch. Everyone‚Äôs like: ‚ÄòWhat‚Äôs that?‚Äô Then the sound of his laugh: ‚ÄòHo, ho, ho.‚Äô It's echoing, it‚Äôs beautiful. It‚Äôs in a forest filled with snow. My mother says: ‚ÄòWho‚Äôs that?‚Äô She‚Äôs smiling. She thinks she‚Äôs in on the dupe. She goes to the door, opens it up, and she starts to say: ‚ÄòHe came!‚Äô But she chokes on the words. Her eyes begin to fill with tears. She looks straight at me, and says: ‚ÄòWho is that?‚Äô I say: ‚ÄòIt‚Äôs Santa Claus, Ma.‚Äô She says: ‚ÄòWhich one?‚Äô And I say: ‚ÄòThe only one.‚Äô‚Äù",
