        "shortCode": "CmFdftNLfOp",
        "caption": "(12/15) ‚ÄúHe was just a man. St. Nicholas was just a man in a village, who gave presents to children. But he was so kind that people remembered his story. They called him Santa. And in 1862 RH Macy put an ad in the paper, saying that Santa had come to his store. That‚Äôs how it all began: one man, one chair. Since that day only 275 men have worn this suit. And not to toot my own horn; but what I do, as this man, I take it very, very seriously. Every time you put on your suit, you get ‚Äòfluffed‚Äô by the make-up people. Some guys need 5 or 10 minutes‚Äîsomething is always off. But not me. When I stand in front of them‚Äîthey don‚Äôt touch me. They say: ‚ÄòThank you.‚Äô I take a moment to myself. I picture all the people I‚Äôm going to see that night, and I make it my business. For every single one of them to believe. I muster up all the joy and hope and wonder that I have in my being. All of my Christmas, I pour into this man. And I dupe them all: the kids, the adults. Especially the adults. Kids believe automatically. It‚Äôs the adults that need it; they need to believe. Sometimes I‚Äôll get a call from a friend. They‚Äôll say: ‚ÄòJohnny, my daughter is eleven. She‚Äôs on the fence. Can I bring her in?‚Äô And when she comes to see Santa‚ÄîI know her name, where she lives, how she‚Äôs doing in school. And my friend has their beautiful little child believing for one more year. Just one more year. It‚Äôs such a short time. From one to five you have them. In all their innocence. Before it starts to click in: the real life, the adulthood. First it's only a glimpse; and it clicks back. You get them back. But each year it clicks back less and less. Until it doesn‚Äôt click back. Until your baby boy, the only one you‚Äôve got, comes home from school and says: ‚ÄòDad, my friends and I have been talking. And it‚Äôs logistically impossible for Santa to do all of that in a single night.‚Äô And I knew. I knew I couldn‚Äôt hold him any longer. I went into the bedroom. Tabatha took one look at my face, and said ‚ÄòWhat‚Äôs up?‚Äô I said: ‚ÄòI think our son just told me he doesn‚Äôt believe in Santa.‚Äô And she said: ‚ÄòThank God.‚Äô And we laughed for a second. Then I said: ‚ÄòIt‚Äôs over. This year, when he comes to Santa‚Äîhe comes to me.‚Äù",
