        "shortCode": "CqoBScluChr",
        "caption": "‚ÄúHere‚Äôs something: if my wife and children are upset, or in trouble, I have a physical ache. It‚Äôs a physical thing. That‚Äôs real. But other than that‚ÄîI don‚Äôt feel much. Don‚Äôt get me wrong. It‚Äôs nice when my kids give me a hug and all that jazz. I even participate-- in the same way an actor would participate. But I‚Äôm not overwhelmed from within or anything. My wife is a different story. It‚Äôs night and day. The kissing, the hugging, birthdays, Christmas, all those tropes. But when I watch them it‚Äôs like I‚Äôm looking at a painting. Where there‚Äôs love and happiness and joy and anger, but I‚Äôm just an observer. I can‚Äôt remember it ever being another way. I had a very uptight English upbringing. My mother would never dream of saying: ‚ÄòI love you,‚Äô or anything like that. Annoyed the hell out of my brother. He thought she didn‚Äôt like him. I told him: ‚ÄòYou‚Äôre over thinking that one, mate.‚Äô She did what needed to be done. Who cares if it was connected to a feeling? But I get it. Feelings are about connection and all that. They don‚Äôt cost money. Not to be all John Lennon about it-- but love is a powerful thing. I can appreciate that. As a concept.‚Äù",
