        "shortCode": "CqA_SMsOya2",
        "caption": "‚ÄúWe‚Äôre unpacking it, little by little. She held us all together. Always made sure there was food on the table, always washed our clothes, always took care of me when I was sick.  But she was fierce when we were kids. She‚Äôd get angry with me, zero to a hundred, in a second. I could never understand why. I know she had a tough upbringing: Guatemala, small town, no father. And I‚Äôve had my own share of demons. It‚Äôs been a twenty-year struggle with alcohol. I would come over here completely blacked out, blasting music, acting like a dirtbag. There are neighbors in this building who still won‚Äôt talk to me. I also said some hurtful things to my dad. He wanted nothing to do with me in his final years. But I‚Äôm seven months sober now, so God willing we‚Äôre done with all that. Little by little I‚Äôm trying to be the man of the household. I‚Äôm suppressing old feelings and just trying to help her be comfortable. I‚Äôm not a good cook. But I kill it for breakfast. So on Saturdays I make breakfast: eggs, beans, bread, soup. She‚Äôs a very good soup eater. I try to get everyone seated at the table, and involve my daughters in the conversation. Afterwards I line up some good entertainment. She likes the television. When it‚Äôs warm I‚Äôll take her to the park. A few months ago I brought her to a soccer game at the Red Bull Arena. It was Colombia vs Guatemala‚Äîtoo perfect. My father was Colombian, so we‚Äôre all half-and-half. I maxed out my credit card and bought the whole family tickets. It was unbelievable. A year ago I wouldn‚Äôt have even been able to enjoy it. I‚Äôd have been drinking beers nonstop. I‚Äôd probably have blacked out by halftime. But I was completely sober, watching the field, watching my family enjoy the game. My mom was loving it. She was cheering like crazy. Wearing her Guatemalan jersey.  Guatemalan flags everywhere, and lots of quetzals‚Äîthe national bird. She was in heaven. I honestly think it was one of the best days of her life. Of course I‚Äôm seeing how happy she is, and I‚Äôm like damn. I only wish my dad was here to see all this.‚Äù",
