        "shortCode": "Cmb57YtLS64",
        "caption": "Just returned from Ghana where @pninson held the grand opening of the @dikancenter last weekend-- barely a year after our fundraiser. Our man does not mess around! The city of Accra turned out in force. It was so nice to meet the community of Ghanaian leaders, businesspeople, and artists that have gathered in support of Paul. (A special thanks to the legendary @amoakoboafo for his support.) The library looks beautiful, and Paul has begun to plan the programming for under-served African artists. There‚Äôs a special Story Lab waiting to be filled with computers and cameras. Paul is doing his best to preserve his limited capital. I‚Äôd love to see Apple and Canon step up here. A bit surprised by the walls he‚Äôs hitting there; thought for sure they‚Äôd want to play a meaningful role in this emerging hub of African visual storytelling. But as Paul has shown, he‚Äôll carry the torch alone if needed. (He‚Äôs currently in physical therapy for the back injury he received from carrying so many books.) Paul is taking a few days off for Christmas-- the first break he‚Äôs had in over a year. Enjoy your time with family, my friend. You deserve it. And congratulations on this magnificent achievement. It‚Äôs going to change a lot of lives.",
